(6, '250789711641', '1513677374', '1111', 'Ayinkamiye Pelagie', '10122017', 'Akimanizanye Honarata', 'North', 'Musanze', 'Muko', 'Kivugiza', 'Sangano', 'Gore', '60', 'Umupfakazi', '', 'NA', 'Yes', 'Yego', 'Yego', 'Nagurishije umurima ariko uwo nawugurishije yansigayemo amafaranga none ngo ni nzaze icyangombwa kigaragaza ko nta mugabo mfite.', 'imikoreshereze y ubutaka ', 'Uwo baguze', 'Irindi_sano', 'Ntikiracyemuka', 'Muko', '10122017', '1', '1', '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(7, '250789711641', '1513677374', '1111', 'Ntahomvukiye Anastase', '10122017', 'Dusifumungu Dorida', 'North', 'Musanze', 'Shingiro', 'Gakingo', 'Ntahomvukiye Anastase', 'Gabo', '26', 'Arubatse', 'Dusifumungu dorida', '782419391', 'Yes', 'Yego', 'Yego', 'Ntahomvukiye Anastase ko yaguze isambu  na Kamanutsi theogne gusa iyo sambu yari ibaruyeho guhinga, ntahomvukiye yaguzeho agace gato ko guturamo, ikibazo afite nuko ashaka kubaka agahinda ka gace yaguze kagahinduka ako guturamo, none theogne yabeshye ko', 'imbibi', 'Kamanutsi theogene', 'Umuturanyi', 'Ntikiracyemuka', 'Shingiro', '10122017', '1', '1', '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(8, '250789711641', '1513677374', '1111', 'Dusifumungu Dorida', '10122017', 'Bisamukuri theoneste', 'North', 'Musanze', 'Shingiro', 'Gakindo', 'Gasura', 'Gabo', '34', 'Arubatse', 'Mukasine Angelique', '788936093', 'Yes', 'Yego', 'Yego', 'Yaguze ubutaka na Nyirandahazi Veldiane ariko icyangombwa cyari cyanditseho numugabo wa veldiane witabye Imana, none ihererekanya ryubutaka ryaranze veldiane yasabwe kujya gutanga ikirego murukiko umugabo agakurwa kucyangombwa.', 'kwandikisha ', 'Nyirandahazi Veldiane', 'Umuturanyi', 'Ntikiracyemuka', 'Shingiro', '10122017', '1', '1', '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(9, '250789711641', '1513677374', '1111', 'Ayinkamiye Pelagie', '10122017', 'Kanziga Donathile', 'North', 'Musanze', 'Muko', 'Cyogo', 'Kabere', 'Gore', '42', 'Arubatse', 'Nsengiyumva Salathiel', 'NA', 'Yes', 'Yego', 'Yego', 'umugore wasezeranye n\' umugabo,mpezwa ku mutungo. Kugurisha isambu dufitanye yafatiwe mu mahabara y\'abagore, ndahinga ariko sinsarura arabisarura akagurisha.', 'guhererekanya', 'Nsengiyumva Salathiel', 'Umugabo', 'Ntikiracyemuka', 'Muko', '10122017', '1', '1', '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(10, '250789711641', '1513677374', '1111', 'UWERA Clotilde', '10122017', 'MUKANTWALI Eugenie', 'Kigali', 'Gasabo', 'Ndera', 'Kibenga', 'Nezerwa', 'Gore', '60', 'Umupfakazi', '', '786452840', 'Yes', 'Yego', 'Yego', '.Nahawe  ikibanza na Mutabazi mu gihe cy\'isaranganya ry\'ubutaka ; nyuma yo kugitsindira aburanye na Bashiki be.Mu gihe ntarabona icyangombwa cya burundu, ngitangira kuhahinga,Milindi anyirukanamo ngo yahaguze na Mutabazi', 'kwimurwa ku nyungu rusange', 'Mulindi Jean Pierre', 'Umuturanyi', 'Sinishimiye', 'Ndera', '10122017', '1', '1', '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(11, '250789711641', '1513677374', '1111', 'UZAMUKUNDA Ancille', '10122017', 'NYIRABAGISHA Esprance', 'South', 'Muhanga', 'Kabacuzi', 'Butare', 'Karambo', 'Gore', '59', 'Umupfakazi', '', 'NA', 'Yes', 'Oya', 'Oya', 'Mbere y\'uko uzamukunda yitaba Imana,yahaye iminani abana be ariko hasigara ingarigari itarasohorewe icyangombwa.Abasigaye barayigabanye, none barifuza ko babona icyangombwa cyaho buri wese afite.', 'izungura', 'Abagize umuryango wa Ancille', 'Mukeba', 'Ntikiracyemuka', 'Kabacuzi', '10122017', '1', '1', '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(12, '250789711641', '1513677374', '1111', 'MUKANOHERI Ange', '10122017', 'SIBOMANA Emmanuel', 'South', 'Muhanga', 'Nyamabuye', 'Gahogo', 'Nyarucyamo', 'Gabo', '42', 'Arubatse', 'Marie', 'NA', 'Yes', 'Yego', 'Yego', 'Ikibazo ni rusange: Haribazwa impamvu ubutaka bw\'umuturage bwubatseho inzu; mu ibarura bwitwa ubutaka bwite bw\'akarere, ubusigaye butubatseho ( buhingwa)akaba aribwo bwitwa ubutaka bwite bw\'umuntu.', 'imikoreshereze y ubutaka ', 'Leta', 'Irindi_sano', 'Ntikirigwaho', 'Nyamabuye', '10122017', '1', '1', '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(13, '250789711641', '1513677374', '1111', 'MUKANOHERI Ange', '10122017', 'Mugirashema Ignas', 'South', 'Muhanga', 'Nyamabuye', 'Gifumba', 'Rutarabana', 'Gabo', '28', 'Ingaragu', '', '784242537', 'Yes', 'Yego', 'Yego', 'Ubutaka bwe bwasohotse ku cyangombwa bwitwa ubutaka butuwe kandi nta nyubako irimo( ubutaka buhingwa). Ikibazo acibwa ubukode bw\'ubutaka butuwe kandi budatuwe', 'imbibi', 'Leta', 'Irindi_sano', 'Ntikiracyemuka', 'Nyamabuye', '10122017', '1', '1', '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(14, '250789711641', '1513677374', '1111', 'MUKANOHERI Ange', '10122017', 'MUKAMANA Thrsia', 'South', 'Muhanga', 'Nyamabuye', 'Gitarama', 'Nyarutovu', 'Gore', '51', 'Umupfakazi', '', 'NA', 'Yes', 'Yego', 'Yego', 'Ubushobozi buke bw\'umuturage ufite icyangombwa cy\'ubutaka atuyeho agomba gusorera amafranga ibihumbi mirongo ine na bitanu( 45 000 frw) ku mwaka ; ikindi abona ari buto bidakwiranye n\'umusoro yakwa.Afite impungenge ko Leta izabumutwara mu gihe atabashije ', 'kwandikisha ', 'Leta', 'Ubuyobozi_bw\'_', 'Ntikirigwaho', 'Nyamabuye', '10122017', '1', '1', '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(15, '250789711641', '1513677374', '1111', 'MUKANOHERI Ange', '10122017', 'MUKASEKURU Anitha', 'South', 'Muhanga', 'Nyamabuye', 'Gahogo', 'Rutenga', 'Gore', '30', 'Arubatse', 'SEMANA Paul', 'NA', 'Yes', 'Yego', 'Oya', 'Nyuma y\'uko ababyeyi bitabye Imana(muri Genocide), abo bavukana bagabanye ubutaka we ntibamuha, ngo ntibavukana.Nyuma yo kuva ku ishuri yasanze barigabanyije ubwo butaka. Kubera ubukene yabuze uko aburana ubutaka n\'abavandimwe be b\'abakire.Akeneye ubuvugi', 'guhererekanya', 'Abavandimwe', 'Musaza/Mushiki', 'Ntikirigwaho', 'Nyamabuye', '10122017', '1', '1', '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(16, '250789711641', '1513677374', '1111', 'Ayinkamiye Pelagie', '10122017', 'Ingabire Florence', 'North', 'Musanze', 'Muko', 'Cyogo', 'Kadahenda', 'Gore', '35', 'Arubatse', 'Tuyambaze', 'NA', 'Yes', 'Yego', 'Oya', 'Twaguze umurima njye numugabo wanjye ,ariko Umwana w\' umugabo wanjye hamwe n\' umugabo baravuga ngo ntabwo bajya kuwandikisha ku murenge ngo baduhe ibyangombwa', 'kwimurwa ku nyungu rusange', 'Tuyambaze', 'Umugabo', 'Ntikiracyemuka', 'Muko', '10122017', '1', '1', '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(17, '250789711641', '1513677374', '1111', 'HAKIZIMANA Lonard', '10122017', 'NIYOKWIZERWA Jol', 'West', 'Karongi', 'Kayenzi', 'Mataba', 'Gikurubuye', 'Gabo', '54', 'Arubatse', 'MUKAGASANA Zilipa', '786394938', 'Yes', 'Yego', 'Yego', 'Ubutaka bwe bwose babubaruye nk\'ubw\'ubucuruzi,kandi hariho igice kinini cyo guturaho.Ibi byakozwe n\'ubuyobozi bw\'umudugudu mu ibarura ry\'ubutaka. Afite ikibazo cy\'uko ubukode bwiyongera kandi ubutaka  bwe bwose atari ubw\'ubucuruzi', 'izungura', 'Leta', 'Irindi_sano', 'Ntikiracyemuka', 'Kayenzi', '10122017', '1', '1', '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(18, '250789711641', '1513677374', '1111', 'Uzamukunda Berthe', '10122017', 'Mukamusana thaciene', 'South', 'Muhanga', 'Shyogwe', 'Mubuga', 'Rwamaraba', 'Gore', '50', 'Arubatse', 'Sikubwabo', '-', 'Yes', 'Yego', 'Oya', 'Turadikanyije isambu,Isambu ye yayiguze numugabo wange bityo kuko tutumvikana akimura imbago afata kubutaka bwange,iyo abayobozi baziteye arongera akazirandura nasubira kurega akantangimbere bakanyita umunyamatiku', 'imikoreshereze y ubutaka ', 'Twagirayezu Theoneste', 'Umuturanyi', 'Sinishimiye', 'Shyogwe', '10122017', '1', '1', '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(19, '250789711641', '1513677374', '1111', 'HABUMUREMYI Thlsphore', '10122017', 'MBUZUKONGIRA Innocent', 'North', 'Musanze', 'Gacaca', 'Kamasa', 'Burengo', 'Gabo', '37', 'Umupfakazi', '', 'NA', 'Yes', 'Oya', 'Yego', 'Izungura hagati y\'umuryango.Ikibazo ni uko umwe abura/ yanga kuza ngo bazungure, bose;bahari nk\'umuryango', 'imbibi', 'NA', 'Irindi_sano', 'Ntikirigwaho', 'Gacaca', '10122017', '1', '1', '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(20, '250789711641', '1513677374', '1111', 'HABUMUREMYI Tlsphore', '10122017', 'MUTUYIMANA Valencie', 'North', 'Musanze', 'Musanze', 'Gacaca', 'Karwasa', 'Gabo', '37', 'Umupfakazi', '', '786904879', 'Yes', 'Oya', 'Oya', 'Umuturage yabaruje isambu, abura ibyangombwa 3 byose; by\'amasambu atatu ari mu tugari 2; Kabirizi na Gasakuza mu murenge wa Gacaca', 'kwandikisha ', 'NA', 'Irindi_sano', 'Ntikirigwaho', 'Musanze', '10122017', '1', '1', '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(21, '250789711641', '1513677374', '1111', 'Ndayisaba G.Danny', '10122017', 'Mutimutuje Yvette', 'West', 'Rubavu', 'Rubavu', 'Mbugangari', 'Gasutamo', 'Gore', '32', 'Ingaragu', '', '783199262', 'Yes', 'Yego', 'Yego', 'Yaguze parcel n,umugabo witwa Djumapili Contact, ahamugurisha kandi hari umugore wa  mbere batandukanye bitemewe n,amategeko, uwo mugore amenye ko Djumapili yahagurishije aza kuburana ubwo butaka bigaragara ko yari abufatanyije na Djumapili umugabo we.', 'guhererekanya', 'Djumapili Contact', 'Umugabo', 'Ntikiracyemuka', 'Rubavu', '10122017', '1', '1', '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(22, '250789711641', '1513677374', '1111', 'Uwingabiye Marie', '10122017', 'Munyempuhwe Ferdinand', 'North', 'Gakenke', 'Muhondo', 'Gahinga', 'Gahinga', 'Gabo', '55', 'Arubatse', 'Niyonsenga Saline', '726611450', 'Yes', 'Yego', 'Oya', 'Ibyangombwa 2 by,ubutaka babihawe ari duplicata. Hari n,Ubundi butaka bwubatseho inzu ataboneye ibyangombwa.', 'kwimurwa ku nyungu rusange', 'Land manager', 'Ubuyobozi_bw\'_', 'Ntikiracyemuka', 'Muhondo', '10122017', '1', '1', '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(23, '250789711641', '1513677374', '1111', 'Uwingabiye Marie', '10122017', 'Uryinanaryo Augustin', 'North', 'Gakenke', 'Muhondo', 'Gihinga', 'Gihinga', 'Gabo', '35', 'Arubatse', 'Ujeneza Dancilla', '728377872', 'Yes', 'Yego', 'Oya', 'Yaguze ubutaka ahagenewe ubuhinzi nyamara nta burenganzira abufiteho, nta cyangombwa yahawe cy, aho yaguze,  Kubw, iyo mpamvu nta nguzanyo yahabwa,nta n,umuriro kandi ubutaka butari mu manege.', 'izungura', 'I iron by,ubutaka', 'Ubuyobozi_bw\'_', 'Ntikiracyemuka', 'Muhondo', '10122017', '1', '1', '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(24, '250789711641', '1513677374', '1111', 'Nzanywayimana Esperance', '10122017', 'Kuradusenge Elizabeth', 'North', 'Gakenke', 'Cyabingo', 'Rukora', 'Murehe', 'Gore', '67', 'Baratandukanye', '', '785351356', 'Yes', 'Yego', 'Yego', 'Kuradusenge Elizabeth aregwa na murumuna we Kuradusenge Angella uba muri Kenya ngo nazane amasambu se  yamuhaye yose  ngo bayagabane bushyashya kuko ngo se yamuhaye adahari. Yaregeje urukiko rw,ibanze aratsindwa ajuririra murwisumbuye naho aratsindwa, Yon', 'imikoreshereze y ubutaka ', 'Dusabimana Angella', 'Irindi_sano', 'Ntikiracyemuka', 'Cyabingo', '10122017', '1', '1', '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(25, '250789711641', '1513677374', '1111', 'Mutuyimana Emerithe', '10122017', 'Nsengimana Innocent', 'North', 'Gakenke', 'Kivuruga', 'Cyintare', 'Buhuga', 'Gabo', '31', 'Arubatse', 'Nyiransengiyumva Eugenie', '782828288', 'Yes', 'Yego', 'Yego', 'Kuba afite ubutaka yabaruje, ariko akaba atarabona icyangombwa cya burundu cy,ubutaka', 'imbibi', 'Land manager', 'Ubuyobozi_bw\'_', 'Ntikiracyemuka', 'Kivuruga', '10122017', '1', '1', '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(26, '250789711641', '1513677374', '1111', 'Mutuyimana Emerithe', '10122017', 'Nzabakurikiza Laurent', 'North', 'Gakenke', 'Kicuruga', 'Cyintare', 'Nyarubuye', 'Gabo', '56', 'Arubatse', 'Nyirabagande Annonciata', '783112687', 'Yes', 'Yego', 'Oya', 'Kuba yarahaye umuhungu we isambu  (gutekesha) maze akayigurana umudugudu wo guturamo, uwo ahahaye ahatekesha abakobwa be 2. Umuhungu we yaje kwimukira mu Muvara,  agiye kugurisha uwo umudugudu nyiraho yifuza ko yahisubiza nawe agasubirana aho yari yaramuh', 'kwandikisha ', 'NA', 'Umuturanyi', 'Ntikiracyemuka', 'Kicuruga', '10122017', '1', '1', '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(27, '250789711641', '1513677374', '1111', 'Mutuyimana Emerithe', '10122017', 'Rwagakiga Jean d,Amour', 'North', 'Gakenke', 'Kivuruga', 'Cyintare', 'Cyintare', 'Gabo', '33', 'Arubatse', 'Dusabimana Phoibe', '783124116', 'Yes', 'Yego', 'Yego', 'Mu gusohoka kw, ibyangombwa by,ubutaka ntabwo icyangombwa cye kigeme gusohoka,  nyuma yagiye kubaruza ubutaka ntiyabona nomero you, ubutaka ndetse n,icyangombwa cya, ubutaka. Kugeza ubu ntabwo arabona icyangombwa cya burundu.', 'guhererekanya', 'Land manager', 'Ubuyobozi_bw\'_', 'Ntikiracyemuka', 'Kivuruga', '10122017', '1', '1', '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(28, '250789711641', '1513677374', '1111', 'Kayiganwa Janviere', '10122017', 'Kanamugire Fidele', 'West', 'Rubavu', 'Nyamyumba', 'Rubona', 'Tagaza', 'Gabo', '47', 'Arubatse', 'Mukasine Florence', '788586207', 'Yes', 'Yego', 'Yego', 'Kuba afite ubutaka bafite icyangombwa cyo gutura, ariko yashatse kubugurisha, bash yizi mu mashini nomero yacyo bamubwira ko ubutaka bwe buri muri zone verte,  none akaba yibaza icyo yakora kugirango abone uburenganzira bwo kugurisha ubwo butaka.', 'kwimurwa ku nyungu rusange', 'Land manager', 'Ubuyobozi_bw\'_', 'Ntikiracyemuka', 'Nyamyumba', '10122017', '1', '1', '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(29, '250789711641', '1513677374', '1111', 'Uwiringiyimana Charles', '10122017', 'Uwiringiyimana Charles', 'West', 'Rubavu', 'Nyundo', 'Gatovu', 'Busheru', 'Gabo', '27', 'Ingaragu', '', '783228833', 'Yes', 'Yego', 'Yego', 'Yaguze umurima n,umuntu wapfuye ,nyuma abana be baza kugabana uwo murama. Yaje kugura n,umwe muribo umugabane we none ashaka ku on a icyangombwa cy, ubutaka . Ikibazo kibazo yagishyikirije ubuyobozi bwurubyiruko, Akagari nticyakemuka.', 'izungura', 'Bashinja Jean', 'Umuturanyi', 'Ntikiracyemuka', 'Nyundo', '10122017', '1', '1', '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(30, '250789711641', '1513677374', '1111', 'Mukakagina Christine', '10122017', 'Mukamurenzi Suzanne', 'South', 'Muhanga', 'Rugendabari', 'Kanyana', 'Ntonde', 'Gore', '90', 'Umupfakazi', '', '783355256', 'Yes', 'Yego', 'Yego', 'Abantu 2 Twizerimana Andre na Hategekimana Charles bamurange mu rukiko rwose buyer rwa muhanga,  ikirego ntabwo cyakiriwe  n,urubyiruko  ariko Hategekimana yakoresheje irangizarubanza ku muhesha w, inkiko utari uw,umwuga would mu murenge wa Rugendabari hi', 'imikoreshereze y ubutaka ', 'Umurenge', 'Ubuyobozi_bw\'_', 'Ntikiracyemuka', 'Rugendabari', '10122017', '1', '1', '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(31, '250789711641', '1513677374', '1111', 'Ntamushobora Elida', '10122017', 'Ntamushobora Elida  (Ruhinguka Chrysologue family)', 'West', 'Rubavu', 'Mudende', 'Rwanyakayaga', 'Nyamugali', 'Gore', '42', 'Arubatse', 'Semitwe Pierre Celestin', '0788905990/0789419638', 'Yes', 'Oya', 'Oya', 'Ikibazo ni amafaranga y\' inguranwa muri expropriation ya Gishwati yatanzwe muri OP No 990900000/0251/15 mu kagali ka kijote, umurenge wa Bigogwe  habayeho kwibeshya kuri bank aho bayohereje kuri No 996 Sacco Nyakiriba kandi nimero yanjye ari 996 Sacco Mud', 'imbibi', 'Ministeri y\' amashyamba na BNR', 'Nta_sano', 'Ntikiracyemuka', 'Mudende', '10122017', '1', '1', '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(32, '250789711641', '1513677374', '1111', 'HABUMUREMYI Thlsphore', '10122017', 'BAZITAKERA Thomas', 'North', 'Musanze', 'Gacaca', 'Rwasa', 'Kavumu', 'Gabo', '48', 'Arubatse', 'UKUTEGETSE Devotha', '784905076', 'Yes', 'Yego', 'Oya', 'Afite ikibazo cy\'uko inzego yagiyemo zose zamwangiye ko ahinduza amazina ari ku cyangombwa cy\'ubutaka; hagati ye n\'uwo baguze.Bamwohereje mu rukiko.Hagati aho urwego yagezeho rwose yabashije kubereka ibyangombwa byose bamusabaga', 'kwandikisha ', 'Leta', 'Irindi_sano', 'Ntikirigwaho', 'Gacaca', '10122017', '1', '1', '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(33, '250789711641', '1513677374', '1111', 'HABUMUREMYI Thlsphore', '10122017', 'BUNANI Simon', 'North', 'Musanze', 'Gacaca', 'Gacaca', 'Kabukende', 'Gabo', '0', 'Umupfakazi', '', 'NA', 'Yes', 'Oya', 'Oya', 'Afite utujetons gusa. Ariko ntabyangombwa afite, nta na makuru afite y\' ibyangombwa by\' imirima.', 'guhererekanya', 'Ni icye kugiti cye', 'Irindi_sano', 'Ntikirigwaho', 'Gacaca', '10122017', '1', '1', '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(34, '250789711641', '1513677374', '1111', 'HABUMUREMYI Tlsphore', '10122017', 'GAHUTU Laurent', 'North', 'Musanze', 'Gacaca', 'Rwasa', 'Kavumu', 'Gabo', '0', 'Umupfakazi', '', '783565712', 'Yes', 'Yego', 'Oya', 'Icyangombwa cyajeho amazina atari aye .Kugeza ubu yabuze igisubizo', 'kwimurwa ku nyungu rusange', 'NA', 'Irindi_sano', 'Ntikirigwaho', 'Gacaca', '10122017', '1', '1', '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(35, '250789711641', '1513677374', '1111', 'Uzamukunda Berthe', '10122017', 'Uzanyinzoga Jeanne', 'South', 'Muhanga', 'Shyogwe', 'Mubuga', 'Mapfundo', 'Gore', '65', 'Arubatse', 'Munyabigwi landouard', '-', 'Yes', 'Yego', 'Yego', 'Umugabo wange yabyaye abana batatu ku nshoreke none abo bana barimo baransaba umunani ku isambu nigabaniye kwa mabukwe kandi barabahaye umunani ku isambu yumuryango.', 'izungura', 'Ngiruwonsanga Samuel, Niyoyambere Anicet', 'Umwana_w\'_umug', 'Ntikiracyemuka', 'Shyogwe', '10122017', '1', '1', '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(36, '250789711641', '1513677374', '1111', 'KANZIGA Jeanne d\'Arc', '10122017', 'NKUNDEBANGE Livin', 'North', 'Gakenke', 'Muyongwe', 'Gisiza', 'Muramba', 'Gabo', '40', 'Arubatse', 'MUKAMUSONERA Bonifrida', '781175516', 'Yes', 'Yego', 'Yego', 'Noteriasaba amafaranga ( ya notification) abazungura b\'umubyeyi wapfuye. Ibyo ngo kugirango buri mwana wazunguye abone icyangombwa cy\'ubutaka cye kiri mu mazina ye bwite', 'imikoreshereze y ubutaka ', 'Noteri', 'Nta_sano', 'Ntikiracyemuka', 'Muyongwe', '10122017', '1', '1', '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(37, '250789711641', '1513677374', '1111', 'Rusatira Stephane', '10122017', 'Nkundiye Alphonse', 'North', 'Gakenke', 'Janja', 'Gatwa', 'Gitega', 'Gabo', '59', 'Arubatse', 'Mutegwaraba Justine', '783027967', 'Yes', 'Yego', 'Oya', 'Umuhungu wanjye Imanirabaruta Eric yabaruje imirima 9 kuri nyina (umugore wanjye wapfuye), none icyangombwa ntibyasohotse , n\' utujeto (UPIs) yaraduhishe, ibibazo nabigejeje ku umuryango arawusuzugura, bigeze ku umurenge ushinzwe ubutaka amutumiza 2 nawe ', 'imbibi', 'Imanirabaruta Eric', 'son_daughter', 'Ntikiracyemuka', 'Janja', '10122017', '1', '1', '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(38, '250789711641', '1513677374', '1111', 'KANZIGA Jeanne d\'Arc', '10122017', 'MUKANDENGO Languida', 'North', 'Gakenke', 'Muyongwe', 'Karyango', 'Mugera', 'Gore', '44', 'Arubatse', 'BUZIGE Boniface', '786207363', 'Yes', 'Yego', 'Oya', 'Mukandengo Languida yaguze isanbu  aranayandikisha mu rukiko. Nyuma uwo bayiguze yaje kuyimwaka,akoresheje impapuro mpimbano. Avuga ko baburanye, hanyuma Languida aratsindwa; ndetse na nyuma y\'aho hajemo n\'urugomo', 'imbibi', 'RuUZIRABWOBA Juvenal na NSENGIYAREMYE Aphrodis', 'Nta_sano', 'Sinishimiye', 'Muyongwe', '10122017', '1', '1', '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(39, '250789711641', '1513677374', '1111', 'KANZIGA Jeanne d\'Arc', '10122017', 'BAZAMANZA Felicien', 'North', 'Gakenke', 'Muyongwe', 'Karyango', 'Kibingo', 'Gabo', '82', 'Arubatse', 'MUKARUBOGO Adela', 'NA', 'Yes', 'Yego', 'Oya', 'Hari ubutaka uyu BAZAMANZA atarabuje kubera ko yari arwaye. Igice cy\'ubwo butaka butabarujwe, undi muntu yabwibarujeho(ishyamba); ndetse hari n\'ikibanza kirimo inzu bibarujeho.', 'imbibi', 'NTAWUTAYAVUGWA Andr & NYIRIDANDI Clstin ( mwene se mu muryango)', 'Irindi_sano', 'Sinishimiye', 'Muyongwe', '10122017', '1', '1', '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(40, '250789711641', '1513677374', '1111', 'SIFA Sraphine', '10122017', 'BIZIMANA Charles', 'West', 'Rubavu', 'Kanzenze', 'Kirerema', 'Bisesero', 'Gabo', '37', 'Arubatse', 'NYIRAMAHIRWE Ernestine', '788678439', 'Yes', 'Yego', 'Yego', 'Amafaranga y\'inguranwe atabonye ku murima uherereye mu gishwati bitewe nuko konti y\'abaturage yari yaratanze yari yarafunzwe. Nyuna yaje gufunguza indi ariko na n\' ubu ntarayabona.Yagiye no muri BNR bamubwira ko amafaranfa yagarutse kuri konti ifunze', 'imbibi', 'Urwego rushinzwe ubutaka na BNR', 'Nta_sano', 'Ntikiracyemuka', 'Kanzenze', '10122017', '1', '1', '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(41, '250789711641', '1513677374', '1111', 'MBONIGABA Jean Bosco', '10122017', 'AKITEGETSE Florida', 'North', 'Gakenke', 'Minazi', 'Murambi', 'Nyarubuye', 'Gore', '42', 'Arubatse', 'TWAGIRAYEZU J.Damascne', '0784516096/0783784898', 'Yes', 'Oya', 'Oya', 'Abana bagabanye isambu basigiwe n\'umubyeyi wabo amaze gupfa; none buri wese uko ari batanu ( 5) arashaka kubona icyangombwa cye. Ubu icyangombwa cyanditse kuri umwe ( mukuru wabo) witwa MUKESHIMANA.', 'imbibi', 'NA', 'Nta_sano', 'Ntikiracyemuka', 'Minazi', '10122017', '1', '1', '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(42, '250789711641', '1513677374', '1111', 'Mukarukundo Rose', '10122017', 'Mukarurema Florence', 'North', 'Musanze', 'Kimonyi', 'Buramira', 'Kamugeni', 'Gore', '27', 'Arubatse', '_', '782344336', 'Yes', 'Yego', 'Yego', 'Mukarurema Florence avuga ko isambu yumuryango ahagarariye yatishishijwe na se atarapfa akayatisha ngiruwonsanga umuryango utabizi none mukarurema ajya guhinga mumurima wabo ngiruwonsanga akamwirukana', 'imbibi', 'Ngiruwonsanga', 'Umuturanyi', 'Ntikiracyemuka', 'Kimonyi', '10122017', '1', '1', '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(43, '250789711641', '1513677374', '1111', 'MBONIGABA Jean Bosco', '10122017', 'NIYONAMBA Potien', 'North', 'Gakenke', 'Minazi', 'Munyana', 'Kanka', 'Gabo', '32', 'Arubatse', 'UWINGENEYE Theophila', '783291666', 'Yes', 'Yego', 'Yego', 'Naguze isambu ifite icyangombwa; nguraho igice sinabona icyangombwa cyanjye kubera nabonye kubikoresha bihenze cyane kandi na serivise  ziri kure', 'imbibi', 'TWIZEYIMANA Jean Npo', 'Umuturanyi', 'Ntikiracyemuka', 'Minazi', '10122017', '1', '1', '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(44, '250789711641', '1513677374', '1111', 'MBONIGABA Jean Bosco', '10122017', 'TUYISHIMIRE Baptiste', 'North', 'Gakenke', 'Minazi', 'Munyana', 'Kanka', 'Gabo', '25', 'Arubatse', 'NYIRANSENGIMANA Christine', '782303687', 'Yes', 'Yego', 'Yego', 'Naguze ubutaka none twabuze uko tubusatura ngo buri wese abone icyangombwa cye. Birahenze kandi serivise ziri kure', 'imbibi', 'BARIHUTA Obedi', 'Papa/Mama', 'Ntikiracyemuka', 'Minazi', '10122017', '1', '1', '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(45, '250789711641', '1513677374', '1111', 'MBONIGABA Jean Bosco', '10122017', 'TWAGIRINSHUTI Vdaste', 'North', 'Gakenke', 'Kinazi', 'Munyana', 'Nyabitare', 'Gabo', '37', 'Arubatse', 'MUKESHIMANA Clmentine', '783740909', 'Yes', 'Yego', 'Yego', 'Naguze igice kimwe cy\'ubutaka,ubundi busigarana nyirabwo. Twagiye guhinduza ngo mbone icyangombwa cyanjye nsanga birahenze cyane.', 'imbibi', 'KANYAMAHANGA Charles', 'Umuturanyi', 'Ntikirigwaho', 'Kinazi', '10122017', '1', '1', '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(46, '250789711641', '1513677374', '1111', 'Tuyishime Penine', '10122017', 'Nzaryicyompawe Salim', 'West', 'Rubavu', 'Rubavu', 'Gikombe', 'Rebero', 'Gabo', '0', 'Arubatse', 'Nyandwi mwapiri', '0', 'Yes', 'Yego', 'Yego', 'Naguze ubutaka na Nzabonimpa iyeze,  icyo gihe ntacyangombwa cyubwo butaka yari afite gusa yari afite gitansi  , agiye kwireba  aribura mubazafata ibyangombwa,bamwohereza kukarere tugezeyo baratubwira bazadutumiriza. Nyuma dusubirayo baratubwira ngo cyara', 'imbibi', 'Leta', 'Ubuyobozi_bw\'_', 'Ntikiracyemuka', 'Rubavu', '10122017', '1', '1', '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(47, '250789711641', '1513677374', '1111', 'MBONIGABA Jean Bosco', '10122017', 'NDAGIWENIMANA Jacques', 'North', 'Gakenke', 'Minazi', 'Murambi', 'Nyarubuye', 'Gabo', '34', 'Arubatse', 'NYIRANZEYIMANA Betty', '787447670', 'Yes', 'Yego', 'Yego', 'Nagurishije igice cy\'ubutaka; none twagiye gukoresha ikindi cyangombwa cy\'uwo twaguze; batubwira ko bidashoboka. Ubutaka bwanditse ko ari ubw\'ubuhinzi, kandi buri wese akeneye icyangombwa cye', 'imbibi', 'HARERIMANA', 'Umuturanyi', 'Ntikiracyemuka', 'Minazi', '10122017', '1', '1', '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(48, '250789711641', '1513677374', '1111', 'Nyiramugisha Denyse', '10122017', 'Mukarukundo', 'North', 'Musanze', 'Kinigi', 'Nyonirima', 'Nyagisenyi', 'Gore', '35', 'Arubatse', 'Iyamuremye', 'NA', 'Yes', 'Yego', 'Yego', 'Ikibazo mfite ni umuturanyi twadikanyije ahora yimura imbago idutandukanya,none kugeza ubu aho twakira dutandukaniye yaranduye ibiti byarimo ashyiraho uruzitiro rw\' imbaho', 'kwandikisha ', 'Antoine', 'Umuturanyi', 'Sinishimiye', 'Kinigi', '10122017', '1', '1', '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(49, '250789711641', '1513677374', '1111', 'GAHIRE Aster', '10122017', 'TWAGIRIYAREMYE Aloys', 'North', 'Gakenke', 'Ruli', 'Ruli', 'Mugambazi', 'Gabo', '0', 'Arubatse', 'Seraphine', '788678584', 'Yes', 'Yego', 'Yego', 'Ikibazo afite ni uko icyangombwa cye cyanditseho imiturire.Ibi bituma bamusoresha amafaranga ya buri mwaka  kandi abandi baturanye badasora( hatanditseho imiturire). Arasabwa kurenganurwa.', 'kwandikisha ', 'Umukodesha', 'Irindi_sano', 'Ntikiracyemuka', 'Ruli', '10122017', '1', '1', '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(50, '250789711641', '1513677374', '1111', 'GAHIRE Aster', '10122017', 'KIYENDEYE Laurence', 'North', 'Gakenke', 'Ruli', 'Gikingo', 'Kabingo', 'Gore', '0', 'Umupfakazi', '', 'NA', 'Yes', 'Yego', 'Yego', 'Uyu muturage asoreshwa amafaranga kandi arumukene. Ikibazo yakijeje ku murenge ariko ntikirakemuka. Bamwijeje ko bagiye kumukorera ubuvugizi ariko ntacyakozwe.ntiyishoboye kandi bamubwira ko bazamugurishiriza cyamunara', 'kwandikisha ', 'Leta', 'Irindi_sano', 'Ntikiracyemuka', 'Ruli', '10122017', '1', '1', '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(51, '250789711641', '1513677374', '1111', 'GAHIRE Aster', '10122017', 'KARUGENDO Plagie', 'North', 'Gakenke', 'Ruli', 'Ruli', 'Mugambazi', 'Gore', '0', 'Umupfakazi', '', '783258045', 'Yes', 'Yego', 'Yego', 'Umukecuru witwa Mukamutoni yaburanye na Mpagazehe ishyamba.Mpagazehe yaje kumutsinda,ariko icyangombwa cyari cyanditseho KARUGENDO Plagie, kuko mukubaruza bari bafatanije icyangombwa kuberako badikanije ubutaka. Karugendo ashaka guhinduza buri wese akagi', 'kwandikisha ', 'MPAGAZEHE Jean Bosco', 'Musaza/Mushiki', 'Ntikiracyemuka', 'Ruli', '10122017', '1', '1', '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(52, '250789711641', '1513677374', '1111', 'MUKANGANGO Mathilde', '10122017', 'KURUTABARE Alphonse', 'North', 'Gakenke', 'Coko', 'Nyanza', 'Baramba', 'Gabo', '50', 'Ingaragu', '', '782872667', 'Yes', 'Yego', 'Yego', 'Ubutaka bukatwamo imidugudu, nyirabwo KURUTABARE yarafunze. Abandi bantu babwiyandikishaho batamwishyuye, nta n\'ingurane bamuhaye', 'kwandikisha ', 'MUNYENTWARI Adrien na bagenzi be', 'Umuturanyi', 'Ntikiracyemuka', 'Coko', '10122017', '1', '1', '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(53, '250789711641', '1513677374', '1111', 'MUKANGANGO Mathilde', '10122017', 'MANIRARINDA Placde', 'North', 'Gakenke', 'Coko', 'Kiruku', 'Buhuri', 'Gore', '54', 'Arubatse', 'NIYONZIMA Enos', '789510524', 'Yes', 'Yego', 'Oya', 'Ni ubutaka bukomoka kw\'izungura asangiye n\'abavandimwe be ariko kugeza ubu kubwandikisha byaranze. Barasabwa attestation de dc ya mama wabo(icyemezo kigaragaza ko yitabye Imana) mu 1979; kandi kuyibona birakomeye cyane bitewe n\'uko dossiers zari mu mako', 'kwandikisha ', 'Umwanditsi w\'ubutaka ku murenge', 'Ubuyobozi_bw\'_', 'Ntikiracyemuka', 'Coko', '10122017', '1', '1', '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(54, '250789711641', '1513677374', '1111', 'Uzamukunda Berthe', '10122017', 'Uzanyinzoga Jeanne', 'South', 'Muhanga', 'Shyogwe', 'Mubuga', 'Mapfundo', 'Gore', '65', 'Umupfakazi', '', '788436949', 'Yes', 'Yego', 'Yego', 'Umugabo yabyaye abana 3 ku nshoreke none bari kumusaba umunani mu isambu yigabaniyekwa nyirabukwe. Bo bari barabahaye iminani mu isambu y,umuryango. Akaba yifuza ko banana ibyo babahaye nawe akazana aho afite  noneho bakahagabana uko ari 7 (abana 4 na ba ', 'kwandikisha ', 'Ngiruwonsanga Samuel, Bataranga Emmanuel,  Niyoyambere Anicet', 'Umwana_w\'_umug', 'Ntikiracyemuka', 'Shyogwe', '10122017', '1', '1', '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(55, '250789711641', '1513677374', '1111', 'Uzamukunda Berthe', '10122017', 'Mukamusana Thacienne', 'South', 'Muhanga', 'Shyogwe', 'Mubuga', 'Rwamaraba', 'Gore', '50', 'Arubatse', 'Sikubwabo', '788436949', 'Yes', 'Yego', 'Oya', 'Kuba hari abo badikanyije isambu bakaba barayiguze n,umugabo we bityo kuko batumvikana bakemura imbago bafata mukwe, yahamagara abayobozi, bakaza bagatera imbago aho zikwiye, iyo hashize iminsi back baturanyi baraza bakazirandura, yasubira kurega, bakamut', 'kwandikisha ', 'Twagirayezu Theoneste', 'Umuturanyi', 'Sinishimiye', 'Shyogwe', '10122017', '1', '1', '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(56, '250789711641', '1513677374', '1111', 'KAYITESI Marie Gorethe', '10122017', 'Akimanizanye Florence', 'North', 'Gakenke', 'Muzo', 'Kabatezi', 'Runyinya', 'Gore', '40', 'Ingaragu', '', '786467515', 'Yes', 'Yego', 'Oya', 'Ubutaka bwari ubw\' ababyeyi; umushinga CYGANDE uteramo ibiti ku masezerano y\'imyaka 30. Bitewe n\'uko ubu butaka bwatikanije n\'ubwa Leta; bwabarujwe kuri Leta mugihe kibarura. Bamuhaye agapapuro,bamubwira kuzabihinduza; ariko agiyeyo baranga. Arifuza ko ub', 'kwandikisha ', 'Leta', 'Ubuyobozi_bw\'_', 'Ntikiracyemuka', 'Muzo', '10122017', '1', '1', '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(57, '250789711641', '1513677374', '1111', 'MUKADARIYO Providence', '10122017', 'Niyonzima Jean de Dieu', 'North', 'Musanze', 'Busogo', 'Sahara', 'NA', 'Gabo', '45', 'Umupfakazi', '', 'NA', 'Yes', 'Oya', 'Oya', 'NIYONZIMA Jean de Dieu yahinze ubutaka bwe agerekaho n\'ubutari ubwe ( arabubohoza), afite gahunda yo kubugira ubwe.Ubuyobozi bwakigiyemo, bufata umwanzuro ko kigomba gukemukira mu nteko y\'abaturage', 'kwandikisha ', 'NA', 'Ubuyobozi_bw\'_', 'Sinishimiye', 'Busogo', '10122017', '1', '1', '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(58, '250789711641', '1513677374', '1111', 'YAMFASHIJE Sylvanie', '10122017', 'MUKANKURANKA Flicit', 'North', 'Gakenke', 'Mataba', 'Gikombe', 'Gashyushya', 'Gore', '53', 'Umupfakazi', '', '784906314', 'Yes', 'Yego', 'Yego', 'Uyu mubyeyi avuga ko afite isambu  yari irimo inzu,imyaka ihinzemo ndetse n\'urutoki. Umushinga wo gukwirakwiza amashanyarazi ( REG) waje gucishamo umuyoboro wabo; biba ngombwa ko bamuhagarika, bumvikana ko bazamuha ingurane. Ariko kugeza n\'ubu ntibarayimu', 'kwandikisha ', 'Ubuyobozi bwa REG', 'Nta_sano', 'Ntikiracyemuka', 'Mataba', '10122017', '1', '1', '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(59, '250789711641', '1513677374', '1111', 'MANIRIHO Joseph', '10122017', 'NTEZIMANA Vincent', 'North', 'Musanze', 'Cyuve', 'Cyanya', 'Kibande', 'Gabo', '43', 'Arubatse', 'NYIRANGIRIMANA Christine', '782306812', 'Yes', 'Yego', 'Oya', 'Umuturage witwa KAMANZI  Cyiza yareze NTEZIMANA vincent n\'abagenzi be aribo: DUSABIMANA, MUNYANKERA, MUNYENGABE, AHORINYUZE, MUNYAMASHARA na GAHAMANYI. Aba bose baregwaga isaranganya.  KAMANZI Cyiza yaje gutsindwa;mu rukiko rw\'ibanze rwa Muhoza. Ikibazo n', 'kwandikisha ', 'KAMANZI Cyiza', 'Nta_sano', 'Ntikiracyemuka', 'Cyuve', '10122017', '1', '1', '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(60, '250789711641', '1513677374', '1111', 'MANIRIHO Joseph', '10122017', 'NKURUNZIZA Abel', 'North', 'Musanze', 'Cyuve', 'Cyanya', 'Kayange', 'Gabo', '43', 'Arubatse', 'NYIRANSABIMANA Marthe', '783380662', 'Yes', 'Yego', 'Yego', 'NKURUNZIZA Abel yaguze isambu/umurima na Bavuga/NSENGIYUMVA Lonard. Iyo Sambu yagurishijwe na NSENGIYUMVA, yari intekeshwa yahawe na se; MIkEKEMO; ariko ikaba yarabarujwe na  NIZEYIMANA Pauline, umwuzukuru wa Mikekemo; kuberako umuhungu wa MIKEKEMO;Lona', 'guhererekanya', 'NIZEYIMANA Pauline', 'Irindi_sano', 'Ntikiracyemuka', 'Cyuve', '10122017', '1', '1', '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(61, '250789711641', '1513677374', '1111', 'MANIRIHO Joseph', '10122017', 'NKURUNZIZA Abel', 'North', 'Musanze', 'Cyuve', 'Cyanya', 'Kayange', 'Gabo', '43', 'Arubatse', 'NYIRANSABIMANA Marthe', '783380662', 'Yes', 'Yego', 'Yego', 'NKURUNZIZA yaguze umurima/isambu na se wabo; NSENGIYUMVA Lonard (Bavuga). Uyu Lonard akaba ari umuhungu wa Mikekemo; nyiri iyi sambu. Ariko icyangombwa cy\'ubutaka kikaba cyanditse kuri NIZEYIMANA Pauline; umwuzukuru wa Mikekemo.Mikekemo amaze gupfa,baga', 'guhererekanya', 'NIZEYIMANA Pauline', 'Irindi_sano', 'Ntikirigwaho', 'Cyuve', '10122017', '1', '1', '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(62, '250789711641', '1513677374', '1111', 'MANIRIHO Joseph', '10122017', 'NYIRABARERA Anastasie', 'North', 'Musanze', 'Cyuve', 'Cyanya', 'Kibande', 'Gore', '84', 'Umupfakazi', '', 'NA', 'Yes', 'Yego', 'Oya', 'zx c', 'guhererekanya', 'Leta', 'Nta_sano', 'Ntikiracyemuka', 'Cyuve', '10122017', '1', '1', '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(63, '250789711641', '1513677374', '1111', 'MANIRIHO Joseph', '10122017', 'BANGANIRUBUSA Velena', 'North', 'Musanze', 'Cyuve', 'Buruba', 'Bazizana', 'Gore', '68', 'Umupfakazi', '', 'NA', 'Yes', 'Yego', 'Oya', 'Umurima wa BANGANIRUBUSA  Velena wadikanije n\'uwa KABARAGASA. Uyu Kabaragasa yaje kwibaruzaho umurima wa Velena; awufatanya n\'uwe.Kugeza ubu Banganirubusa Velena nta cyangombwa cy\'ubutaka arabona. Ikibazo gikomereye Banganirubusa kuko niyo batumije Kabara', 'guhererekanya', 'KABARAGASA', 'Nta_sano', 'Ntikiracyemuka', 'Cyuve', '10122017', '1', '1', '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(64, '250789711641', '1513677374', '1111', 'MANIRIHO Joseph', '10122017', 'NKURUNZIZA Abel', 'North', 'Musanze', 'Cyuve', 'Cyanya', 'Kayange', 'Gabo', '43', 'Arubatse', 'NYIRANSABIMANA Marthe', '783380662', 'Yes', 'Yego', 'Yego', 'NKURUNZIZA Abel, NZABANDORA Emmanuel,NAYITURIKI Mathias, BAMVURA na NTAMUKUNZI Purisikira ; baguze umurima na Bavuga/NSENGIYUMVA Lonard mwene Mikekemo. Iyo sambu yagurishijweho ibarujweho NIZEYIMANA Pauline,umwuzukuru wa Mikekemo,akaba ari nawe ufite icy', 'guhererekanya', 'NIZEYIMANA Pauline', 'Irindi_sano', 'Ntikiracyemuka', 'Cyuve', '10122017', '1', '1', '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
