(66, '250789711641', '1513677374', '1111', 'NYIRAMBONABUCYA Esprance', '10122017', 'MUKAMAZIMPAKA Sraphine', 'North', 'Gakenke', 'Gashenyi', 'Taba', 'Gihanga', 'Gore', '26', 'Arubatse', 'VUGUZIGA Jean Claude', '785327144', 'Yes', 'Yego', 'Oya', 'Nta cyangombwa cyasohotse. Banditse ko ari igishanga,kandi hirya no hino hatuwe', 'guhererekanya', 'Leta', 'Nta_sano', 'Ntikiracyemuka', 'Gashenyi', '10122017', '1', '1', '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
