(69, '250789711641', '1513677374', '1111', 'Dusifumungu Dolido', '10122017', 'Ntahomvukiye Anastase', 'North', 'Musanze', 'Shingiro', 'Gakingo', 'Burengo', 'Gabo', '26', 'Arubatse', 'Dusifumungu', '782419391', 'Yes', 'Yego', 'Yego', 'Ntahomvukiye Anastase afite ikibazo cy, uko yaguze isambu n,uwitwa Kananutsi Theogene guha iyo sambu yari yaragenewe gahinga. Ntahomvukiye yaguzeho agace gato ko guturamo, gusa ikibazo afite ni uko ashaka kubaka agahinduza aka gace gato yaguze icyari guhi', 'guhererekanya', 'Kamanutsi Theogene', 'Umuturanyi', 'Ntikirigwaho', 'Shingiro', '10122017', '1', '1', '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(70, '250789711641', '1513677374', '1111', 'Dusifumungu Dolido', '10122017', 'Bisanukuri Theoneste', 'North', 'Musanze', 'Shingiro', 'Gakingo', 'Gasura', 'Gabo', '34', 'Arubatse', 'Mukasine Angelique', '785240698', 'Yes', 'Yego', 'Yego', 'Uyu Bisanukuri Theoneste yaguze ubutaka na Nyirandahari Velediane,  icyangombwa cye cyari cyanditseho Verediane n,umugabo we gusa umugabo we yaje kwitaba Imana guhinduriza Bisanukuri Theoneste ngo bakore ihererekanyabubasha biranga bitewe n,uko nyakwigend', 'guhererekanya', 'Nyirandahari Verediane', 'Umuturanyi', 'Ntikiracyemuka', 'Shingiro', '10122017', '1', '1', '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(71, '250789711641', '1513677374', '1111', 'MUKAKANANI Euphanie', '10122017', 'SINDAYIGAYA James', 'North', 'Gakenke', 'Rushashi', 'Joma', 'Rugarama', 'Gabo', '40', 'Ingaragu', '', 'O783457955', 'Yes', 'Yego', 'Oya', 'Yashatse umugore w\'umunyamahanga (Congo) ntibasezerana. Yasabye icyangombwa cy\'ubutaka, bamubwira ko atakibona kubera yamwibarujeho batarasezeranye. Arasaba ko umugore bamukuraho agasigara wenyine, kugirango abashe kubona icyangombwa', 'guhererekanya', 'Leta', 'Ubuyobozi_bw\'_', 'Ntikiracyemuka', 'Rushashi', '10122017', '1', '1', '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(72, '250789711641', '1513677374', '1111', 'MUKAKANANI Euphonie', '10122017', 'Havugimana Diogne', 'North', 'Gakenke', 'Rushashi', 'Shyombwe', 'Gatwa', 'Gabo', '0', 'Arubatse', 'YAMURAGIYE Aullelie', '785230479', 'Yes', 'Yego', 'Oya', 'Ubutaka bwari bwarabaruwe nk\'igishanga kandi ari i musozi. Baje guhindura bubarurwa nk\'ubw\'imusozi; ariko ntibamuha icyangombwa. N\'ubwo afite agapapuro kerekana ko bwabaruwe, nta cyangombwa arabona.', 'guhererekanya', 'NA', 'Irindi_sano', 'Ntikiracyemuka', 'Rushashi', '10122017', '1', '1', '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(73, '250789711641', '1513677374', '1111', 'MUKAKANANI Euphanie', '10122017', 'NTAMITONDERO Lucie', 'North', 'Gakenke', 'Rushashi', 'Joma', 'Nyagasozi', 'Gore', '42', 'Arubatse', 'NA', 'NA', 'Yes', 'Oya', 'Oya', 'Lucie yashatse mu buryo butemewe n\'amategeko, abyarana umwana n\'uwo bashakanye. Umugabo amaze gupfa,isambu bayanditse ku mwana. Umwana akuze,yaje guhabwa umunani. Nibwo bategetse nyina, Lucie,kumuha ubutaka bwose n\'icyangombwa cyabwo.Lucie ntiyigeze abyis', 'guhererekanya', 'Umukobwa wanjye', 'son_daughter', 'Sinishimiye', 'Rushashi', '10122017', '1', '1', '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(74, '250789711641', '1513677374', '1111', 'MUKAKANANI Euphanie', '10122017', 'MUKANKWIYE Marie', 'North', 'Gakenke', 'Rushashi', 'Burimba', 'Kara', 'Gore', '48', 'Umupfakazi', '', '786712160', 'Yes', 'Yego', 'Yego', 'Marie yaguze ubutaka bufite icyangombwa. Bagiye guhinduza ku karere(niho byakorerwaga), bamwizeza ko icyangombwa bazacyohereza kuko yatanze ibisabwa byose. Yarategereje arakibura; asubirayo asanga cyiracyanditse kuwo baguze. Bamutegetse gushaka uwo baguze', 'guhererekanya', 'NA', 'Umuturanyi', 'Ntikiracyemuka', 'Rushashi', '10122017', '1', '1', '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(75, '250789711641', '1513677374', '1111', 'MUKAKANANI Euphanie', '10122017', 'HABIYAKARE Valens', 'North', 'Gakenke', 'Rushashi', 'Burimba', 'Kara', 'Gabo', '53', 'Arubatse', 'NYIRANSABIMANA Laurence', '782718482', 'Yes', 'Yego', 'Oya', 'Icyangombwa bagisohoye cyanditse nabi.Mukubigarura bavuye kubikosora, icya Laurence kirabura,kandi bafite numero. Ubu, ubuyobozi bugaragaza ko ubwo butaka butigeze bubaho, kandi umuturage afite numero yabwo, kandi nabwo burahari', 'guhererekanya', 'Leta', 'Irindi_sano', 'Ntikiracyemuka', 'Rushashi', '10122017', '1', '1', '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(76, '250789711641', '1513677374', '1111', 'MBONIGABA Jean Bosco', '10122017', 'NDACYAYISENGA Alfred', 'North', 'Gakenke', 'Minazi', 'Gasiho', 'Gahombo', 'Gabo', '50', 'Arubatse', 'MUHAWENIMANA Odette', '783650471', 'Yes', 'Yego', 'Yego', 'Yagiranye ikibazo na bishywa be, bahawe umugabane badahari. Aho baziye, banze aho umuryango wabageneye. Bahisemo aha Nyirarume. Ariko ubutaka niwe bwanditseho.', 'guhererekanya', 'Abana ba mushike we ( 3)', 'Irindi_sano', 'Ntikiracyemuka', 'Minazi', '10122017', '1', '1', '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(77, '250789711641', '1513677374', '1111', 'MBONIGABA Jean Bosco', '10122017', 'HABUMUGISHA Innocent', 'North', 'Gakenke', 'Minazi', 'Raba', 'Sarabuye', 'Gore', '40', 'Arubatse', 'MUNGANYINKA Laetitia', '781500579', 'Yes', 'Yego', 'Yego', 'Ubutaka bwaguzwe n\'abantu babiri; bugurwa nyuma y\'ibarura ry\'ubutaka. Mu gihe cyo kubwandikisha, basobanurirwa ko amazina yabo yandikwa ku cyangombwa kimwe. Ntibabashije kubyumvikanaho; basaba ko buri wese yahabwa icyangombwa cye. Ariko bababwiye ko bidas', 'guhererekanya', 'NSHIZIRUNGU Sammuel', 'Umuturanyi', 'Ntikiracyemuka', 'Minazi', '10122017', '1', '1', '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(78, '250789711641', '1513677374', '1111', 'NISHYIREMBERE Janvire', '10122017', 'MUSEMGIMANA Jean Claude', 'North', 'Musanze', 'Nyange', 'Kabeza', 'Rwebeya', 'Gabo', '34', 'Arubatse', 'NISHYIREMBERE Janvire', '783194367', 'Yes', 'Yego', 'Yego', 'Dufite ubutaka buri ku muhanda w\'ubukerarugendo. Bari batubwiye ko tugomba gusiga metero 22 (22m), uvuye ku kibanza. Ubuyobozi bw\'umurenge bwandikiye akarere busaba ko izo metero zagabanywa. Twategereje ko akarere kadusubiza, amaso ahera mu kirere', 'guhererekanya', 'Leta', 'Nta_sano', 'Ntikiracyemuka', 'Nyange', '10122017', '1', '1', '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(79, '250789711641', '1513677374', '1111', 'TUYISENGE Jean Bosco', '10122017', 'SIBOMANA Augustin', 'West', 'Karongi', 'Murundi', 'Nzaratsi', 'NYAMABUYE', 'Gabo', '21', 'Ingaragu', '', '723934937', 'Yes', 'Yego', 'Yego', 'SIBOMABA Augustin yaguze ubutaka na HABYALIMANA Prince, wari SEDO w\'akagari ka Mubuga. Habyalimana nawe yari yarabuguze na MUKABWANA Josephine; wabugurishije atarabona icyangombwa.Nyuma yo kugurisha yahise yimukira mukandi kagari.Ikibazo yanze kuza guhind', 'imbibi', 'Habyalimana Prince', 'Irindi_sano', 'Ntikiracyemuka', 'Murundi', '10122017', '1', '1', '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(80, '250789711641', '1513677374', '1111', 'MUKAKINANI Clothilde', '10122017', 'HABARUGIRA Uziel', 'West', 'Karongi', 'Ruganda', 'Rubona', 'Maryohe', 'Gabo', '42', 'Arubatse', 'NYIRANZACAHINYERETSE Anathalie', 'NA', 'Yes', 'Oya', 'Oya', 'Ni ubutaka avuga ko yasigiwe na se wabo utuye mu Bugesera. Abyutsa ikibazo gusa iyo bahinduye umuyobozi w\'akagari cyangwa uw\'umurenge', 'kwandikisha ', 'MUKABAZIGA Souzane', 'Mukadata/Umuga', 'Sinishimiye', 'Ruganda', '10122017', '1', '1', '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(81, '250789711641', '1513677374', '1111', 'MUKAKINANI Clothilde', '10122017', 'MUKAGASANA Yulida', 'West', 'Karongi', 'Ruganda', 'Nyamugwagwa', 'Nyamugwagwa', 'Gore', '40', 'Umupfakazi', '', '723156377', 'Yes', 'Yego', 'Oya', 'Bategereje ko icyangombwa gisohoka. Mu iraga bamuhaye hato none  ari kwiyenza kubahawe hanini', 'guhererekanya', 'NGIRINSHUTI Athanase', 'Irindi_sano', 'Ntikiracyemuka', 'Ruganda', '10122017', '1', '1', '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(82, '250789711641', '1513677374', '1111', 'UWAYEZU Rose', '10122017', 'NTEZIYAREMYE Onesphore', 'South', 'Muhanga', 'Nyarusange', 'Rusovu', 'Rwambariro', 'Gabo', '58', 'Arubatse', 'MUKAGAKWAYA Jacqueline', '728095911', 'Yes', 'Yego', 'Yego', 'NTEZIYAREMYE Onesphore yagurishije ikibanza, ariko ntiyahagurisha hose. Yaje kugira ikibazo ibyangombwa by\'ubutaka bitangwa afunze; ndetse n\'ahasigaye hagenderamo. NSHUTIYIMANA Sylveni arashaka kuhikubira hose, yitwaje ko ari we ufite icyangombwa cy\'ubwo ', 'kwimurwa ku nyungu rusange', 'NSHUTIYIMANA Sylveni', 'Umuturanyi', 'Ntikiracyemuka', 'Nyarusange', '10122017', '1', '1', '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(83, '250789711641', '1513677374', '1111', 'UWAYEZU Rose', '10122017', 'NZABAMWITA Ephrem', 'South', 'Muhanga', 'Nyarusange', 'Rusovu', 'Rwambariro', 'Gabo', '38', 'Arubatse', 'UWAYEZU Rose', '788793153', 'Yes', 'Yego', 'Yego', 'NZABAMWITA Ephrem yaguze umurima urimo ishyamba awugura na Protais. Uwo murima Protais yari yarawuguze na mushiki we Lucie; igihe umugabo wa Lucie atabaga mu rugo. Lucie yaje kubura amafaranga yo kurihira abana ishuri, biba ngombwa ko awugurisha. None umu', 'izungura', 'Protais', 'Umuturanyi', 'Ntikiracyemuka', 'Nyarusange', '10122017', '1', '1', '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
