(85, '250789711641', '1513677374', '1111', 'MUREKATETE Providence', '10122017', 'NTAKIRUTIMANA Innocent', 'North', 'Gakenke', 'Karambo', 'Kirehe', 'Bukunga', 'Gabo', '33', 'Arubatse', 'NYIRABARANDIRA Jack', '786639655', 'Yes', 'Yego', 'Yego', 'Ni amakimbirane ashingiye ku muyoboro w\'amazi ( umugenda), uri hagati y\'umurima', 'imbibi', 'MATARIKI Gaspard', 'Umuturanyi', 'Ntikiracyemuka', 'Karambo', '10122017', '1', '1', '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
