(110, '250789711641', '1513677374', '1111', 'AYINKAMIYE Clotilde', '10122017', 'NYIRABAMPORIKI Antoinette', 'West', 'Karongi', 'Gitesi', 'Kanunga', 'Nemba', 'Gore', '52', 'Umupfakazi', '', 'NA', 'Yes', 'Yego', 'Oya', 'Twaburanye isambu n\'umuhungu wanjye, nyuma urukiko rw\'ibanze rurangije urubanza; uwo muhungu wanjye ashinga imbago nabi; bashyira imbibi ahatari ho', 'izungura', 'JYAMBERE Frderic', 'son_daughter', 'Ntikiracyemuka', 'Gitesi', '10122017', '1', '1', '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(111, '250789711641', '1513677374', '1111', 'AYINKAMIYE Clotilde', '10122017', 'MUKARUKAKA Esther', 'West', 'Karongi', 'Gitesi', 'Munanira', 'Gahigiro', 'Gore', '43', 'Baratandukanye', '', 'NA', 'Yes', 'Yego', 'Yego', 'Nahawe imirima itandatu (6) na Databukwe na Mabukwe. Umugabo twari twarashakanye, yaje kunyirukana; ikibazo naje gusubira kujya mpinga imirima yanjye; akajya ayinyima kandi narayihawe, mfite n\'urupapuro rwanditse.', 'izungura', 'Babonampoze ( umugabo wanjye)', 'Umugabo', 'Ntikiracyemuka', 'Gitesi', '10122017', '1', '1', '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(112, '250789711641', '1513677374', '1111', 'AYINKAMIYE Clotilde', '10122017', 'MUKANTAGARA Console', 'West', 'Karongi', 'Gitesi', 'Nyamiringa', 'Burega', 'Gore', '62', 'Baratandukanye', '', 'NA', 'Yes', 'Yego', 'Yego', 'Twasigaye turi babiri, njye na Musaza wanjye. Amasambu badusigiye ashaka kuyiharira wenyine, ngo jye ntacyo nabona, kuko ndi umukobwa. Kandi ndi indushyi itagira kirengera', 'izungura', 'RWABAKIKA Michel', 'Musaza/Mushiki', 'Ntikiracyemuka', 'Gitesi', '10122017', '1', '1', '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(113, '250789711641', '1513677374', '1111', 'Sifa Sraphine', '10122017', 'SIKUBWABO Nehemie', 'West', 'Karongi', 'Gitesi', 'Munanira', 'Munanira', 'Gabo', '31', 'Arubatse', 'YANDEREYE Claudine', '785358335', 'Yes', 'Yego', 'Yego', 'Naguze ubutaka na MUJYAMBERE Jrme; none uwo mugabo yarabuze, nta muntu uzi aho aherereye.Ikibazo yabuze hatarabaho guhinduza ibyangombwa ngo ubutaka bunyandikweho kuko twabuguze', 'izungura', 'MUNYABARAME Jrme', 'Nta_sano', 'Ntikiracyemuka', 'Gitesi', '10122017', '1', '1', '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(114, '250789711641', '1513677374', '1111', 'YAMFASHIJE Sylvanie', '10122017', 'MUKARUKAKA Esther', 'West', 'Karongi', 'Gitesi', 'Munanira', 'Gahigiro', 'Gore', '43', 'Baratandukanye', '', 'NA', 'Yes', 'Yego', 'Yego', 'Nari nahawe umurima  na Databukwe na Mabukwe, nk\'impano.Nyuma umugabo yaje kunyirukana.Tumaze gutandukana, barahanyambura, kandi inyandiko y\'uko bampaye ndayifite ndetse n\'ubutaka nabwibarujeho ko ari ubwanjye.', 'izungura', 'Umugabo twashakanye', 'Umugabo', 'Ntikiracyemuka', 'Gitesi', '10122017', '1', '1', '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(115, '250789711641', '1513677374', '1111', 'YAMFASHIJE Sylvanie', '10122017', 'NYIRAMIHIGO Sophie', 'West', 'Karongi', 'Gitesi', 'Gasharu', 'Gasharu', 'Gore', '81', 'Umupfakazi', '', 'NA', 'Yes', 'Yego', 'Oya', 'Jye na murumuna wanjye, twaragijwe isambu n\'ababyeyi.Batubwiye ko musaza wacu naza tuzayimuha.Ababyeyi bongeraho ko naramuka abuze, tuzayigabana.None kuva 1994, ntaragaruka.Ikibazo nuko mu kujya kuyigabana, murumuna wanjye ari kuyiharira yitwaje impapuro ', 'izungura', 'NYIRABIRIKUNZIRA Eliana', 'Irindi_sano', 'Ntikiracyemuka', 'Gitesi', '10122017', '1', '1', '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(116, '250789711641', '1513677374', '1111', 'Mukeshimana Nathalie', '10122017', 'HABIMANA Jean Npomuscne', 'West', 'Karongi', 'Gitesi', 'Munanira', 'Gahigiro', 'Gabo', '35', 'Arubatse', 'AYINKAMIYE Clotilde', '788817048', 'Yes', 'Yego', 'Yego', 'Leta yamfatiye ubutaka, bitewe n\'isoko y\'amazi ihabonye. Ubwo butaka yarabufatiriye, ntiyampa n\'ingurane yabwo, kandi na njye narabukoreshaga, mu gutunga umuryango wanjye', 'izungura', 'Leta', 'Nta_sano', 'Ntikiracyemuka', 'Gitesi', '10122017', '1', '1', '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(117, '250789711641', '1513677374', '1111', 'MUREKATETE Esprance', '10122017', 'HITIYAREMYE Rachel', 'West', 'Karongi', 'Gitesi', 'Gitega', 'Bugoberi', 'Gore', '57', 'Umupfakazi', '', '788860534', 'Yes', 'Yego', 'Oya', 'Nabuze icyangombwa cy\'ubutaka bwanjye, kandi narafotoje ubutaka.Mu gihe iby\'abandi byasohokaga, icyanjye ntikigeze gisohoka.Nageze mu buyobozi, bantuma agapapuro k\'ubutaka ndagatanga, ariko maze amezi atatu njyayo gushaka ibyangombwa nkabibura.Nkaba ndi k', 'izungura', 'Leta', 'Irindi_sano', 'Ntikiracyemuka', 'Gitesi', '10122017', '1', '1', '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(118, '250789711641', '1513677374', '1111', 'MUREKATETE Esperance', '10122017', 'NYIRARWIMO Farasie', 'West', 'Karongi', 'Gitesi', 'Rwariro', 'Kigarama', 'Gore', '67', 'Umupfakazi', '', 'NA', 'Yes', 'Yego', 'Oya', 'Ikibazo cyanjye nuko nahawe umunani n\'ababyeyi banjye batarapfa, nyuma bamaze gupfa, musaza wanjye arabinyambura', 'izungura', 'RWANUMA Ezekiel', 'Musaza/Mushiki', 'Sinishimiye', 'Gitesi', '10122017', '1', '1', '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
