(1, '2.5079E+11', '1513677374', '1111', 'gufata ku ngufu', '', 'Kaminuza Daniel', 'Gashenyi', '', 'Gabo', '789741641', 'Ntawiheba Celestin', 'Gabo', 'North', 'Gakenke', 'Gashenyi', 'Rutenderi', 'Kibara', '10122017', 'Kugaragaza  imbibi zubutaka  bwa leta nubwa ntawiheba  Celestin', 'ok', '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(2, '2.5079E+11', '1513677374', '1111', 'gufata ku ngufu', '', 'Renzaho Bernard.', 'Kanama', '', 'Gabo', '789741641', 'BATIBUKA JONATHAN', 'Gabo', 'North', 'Rubavu', 'Kanama', 'Mahoko', 'Nyamirambo', '10122017', 'Bamwangirije ubutaka bakora umuhanda Mahoko-Nkomane. Ikibazo ni uko baguze nawe ubutaka(ibicangarayi) none ntibamwishyuye n\'inshuro n\'imwe', 'ok', '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(3, '2.5079E+11', '1513677374', '1111', 'gufata ku ngufu', '', 'Mujawamariya jeanne', 'Gashenyi', '', 'Gabo', '789741641', 'Mpamagarande', 'Gabo', 'North', 'Gakenke', 'Gashenyi', 'Taba', 'Gasharu', '10122017', 'Kuzungura  ubutaka bwimana we witabye imana', 'ok', '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(4, '2.5079E+11', '1513677374', '1111', 'gufata ku ngufu', '', 'Tuzahabwanimana Eric', 'Gashenyi', '', 'Gore', '789741641', 'Mukamazimpaka Seraphine', 'Gore', 'North', 'Gakenke', 'Gashenyi', 'Taba', 'Gihanga', '10122017', 'Ntacangombwa cyasotse  kandi ubutaka bwanditseho ko ari igishanga  kandi hirya no hino hatuwe', 'ok', '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(5, '2.5079E+11', '1513677374', '1111', 'gufata ku ngufu', '', 'Liberakurora J Baptiste', 'Muko', '', 'Gore', '789741641', 'Nyirahabinka Drocella', 'Gabo', 'North', 'Musanze', 'Muko', 'Cyivugiza', 'Nyagahondo', '10122017', 'Ndi umugore w\'isezerano,umugabo wanjye yabyaranye nundi mugore bivamo impamvu yo guteza cyamunara bumwe mu butaka bwacu.  Ubu yabyaranye nundi mugore, ubu ndi mu nzira zo kuba umutindi nyakujya. Mumpe Inama nkore iki?', 'ok', '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(6, '2.5079E+11', '1513677374', '1111', 'gufata ku ngufu', '', 'MANIRAKIZA Gerard', 'Muko', '', 'Gore', '789741641', 'Akimanizanye Honarata', 'Gabo', 'North', 'Musanze', 'Muko', 'Kivugiza', 'Sangano', '10122017', 'Nagurishije umurima ariko uwo nawugurishije yansigayemo amafaranga none ngo ni nzaze icyangombwa kigaragaza ko nta mugabo mfite.', 'ok', '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(7, '2.5079E+11', '1513677374', '1111', 'gufata ku ngufu', '', 'Uwitonze jean d\'amour', 'Shingiro', '', 'Gabo', '789741641', 'Dusifumungu Dorida', 'Gabo', 'North', 'Musanze', 'Shingiro', 'Gakingo', 'Ntahomvukiye Anastase', '10122017', 'Ntahomvukiye Anastase ko yaguze isambu  na Kamanutsi theogne gusa iyo sambu yari ibaruyeho guhinga, ntahomvukiye yaguzeho agace gato ko guturamo, ikibazo afite nuko ashaka kubaka agahinda ka gace yaguze kagahinduka ako guturamo, none theogne yabeshye ko', 'ok', '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(8, '2.5079E+11', '1513677374', '1111', 'gufata ku ngufu', '', 'Habiyaremye jean bosco', 'Shingiro', '', 'Gabo', '789741641', 'Bisamukuri theoneste', 'Gabo', 'North', 'Musanze', 'Shingiro', 'Gakindo', 'Gasura', '10122017', 'Yaguze ubutaka na Nyirandahazi Veldiane ariko icyangombwa cyari cyanditseho numugabo wa veldiane witabye Imana, none ihererekanya ryubutaka ryaranze veldiane yasabwe kujya gutanga ikirego murukiko umugabo agakurwa kucyangombwa.', 'ok', '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(9, '2.5079E+11', '1513677374', '1111', 'gufata ku ngufu', '', 'Mbangutse Sylvain', 'Muko', '', 'Gore', '789741641', 'Kanziga Donathile', 'Gabo', 'North', 'Musanze', 'Muko', 'Cyogo', 'Kabere', '10122017', 'umugore wasezeranye n\' umugabo,mpezwa ku mutungo. Kugurisha isambu dufitanye yafatiwe mu mahabara y\'abagore, ndahinga ariko sinsarura arabisarura akagurisha.', 'ok', '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(10, '2.5079E+11', '1513677374', '1111', 'gufata ku ngufu', '', 'Mberabagabo Jean Baptiste', 'Ndera', '', 'Gore', '789741641', 'MUKANTWALI Eugenie', 'Gabo', 'Kigali', 'Gasabo', 'Ndera', 'Kibenga', 'Nezerwa', '10122017', '.Nahawe  ikibanza na Mutabazi mu gihe cy\'isaranganya ry\'ubutaka ; nyuma yo kugitsindira aburanye na Bashiki be.Mu gihe ntarabona icyangombwa cya burundu, ngitangira kuhahinga,Milindi anyirukanamo ngo yahaguze na Mutabazi', 'ok', '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(11, '2.5079E+11', '1513677374', '1111', 'gufata ku ngufu', '', 'Hakizimana Juvenal', 'Kabacuzi', '', 'Gore', '789741641', 'NYIRABAGISHA Esprance', 'Gore', 'South', 'Muhanga', 'Kabacuzi', 'Butare', 'Karambo', '10122017', 'Mbere y\'uko uzamukunda yitaba Imana,yahaye iminani abana be ariko hasigara ingarigari itarasohorewe icyangombwa.Abasigaye barayigabanye, none barifuza ko babona icyangombwa cyaho buri wese afite.', 'ok', '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(12, '2.5079E+11', '1513677374', '1111', 'gufata ku ngufu', '', 'Bosenibo Daniel', 'Nyamabuye', '', 'Gabo', '789741641', 'SIBOMANA Emmanuel', 'Gore', 'South', 'Muhanga', 'Nyamabuye', 'Gahogo', 'Nyarucyamo', '10122017', 'Ikibazo ni rusange: Haribazwa impamvu ubutaka bw\'umuturage bwubatseho inzu; mu ibarura bwitwa ubutaka bwite bw\'akarere, ubusigaye butubatseho ( buhingwa)akaba aribwo bwitwa ubutaka bwite bw\'umuntu.', 'ok', '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(13, '2.5079E+11', '1513677374', '1111', 'gufata ku ngufu', '', 'Nshimiyimana Theogene', 'Nyamabuye', '', 'Gabo', '789741641', 'Mugirashema Ignas', 'Gabo', 'South', 'Muhanga', 'Nyamabuye', 'Gifumba', 'Rutarabana', '10122017', 'Ubutaka bwe bwasohotse ku cyangombwa bwitwa ubutaka butuwe kandi nta nyubako irimo( ubutaka buhingwa). Ikibazo acibwa ubukode bw\'ubutaka butuwe kandi budatuwe', 'ok', '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(14, '2.5079E+11', '1513677374', '1111', 'gufata ku ngufu', '', 'Nzabonimpa Valens', 'Nyamabuye', '', 'Gore', '789741641', 'MUKAMANA Thrsia', 'Gabo', 'South', 'Muhanga', 'Nyamabuye', 'Gitarama', 'Nyarutovu', '10122017', 'Ubushobozi buke bw\'umuturage ufite icyangombwa cy\'ubutaka atuyeho agomba gusorera amafranga ibihumbi mirongo ine na bitanu( 45 000 frw) ku mwaka ; ikindi abona ari buto bidakwiranye n\'umusoro yakwa.Afite impungenge ko Leta izabumutwara mu gihe atabashije ', 'ok', '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(15, '2.5079E+11', '1513677374', '1111', 'gufata ku ngufu', '', 'Mwanzimwabo  Jean Bosco', 'Nyamabuye', '', 'Gore', '789741641', 'MUKASEKURU Anitha', 'Gabo', 'South', 'Muhanga', 'Nyamabuye', 'Gahogo', 'Rutenga', '10122017', 'Nyuma y\'uko ababyeyi bitabye Imana(muri Genocide), abo bavukana bagabanye ubutaka we ntibamuha, ngo ntibavukana.Nyuma yo kuva ku ishuri yasanze barigabanyije ubwo butaka. Kubera ubukene yabuze uko aburana ubutaka n\'abavandimwe be b\'abakire.Akeneye ubuvugi', 'ok', '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(16, '2.5079E+11', '1513677374', '1111', 'gufata ku ngufu', '', 'Ndizeye Theoneste', 'Muko', '', 'Gore', '789741641', 'Ingabire Florence', 'Gore', 'North', 'Musanze', 'Muko', 'Cyogo', 'Kadahenda', '10122017', 'Twaguze umurima njye numugabo wanjye ,ariko Umwana w\' umugabo wanjye hamwe n\' umugabo baravuga ngo ntabwo bajya kuwandikisha ku murenge ngo baduhe ibyangombwa', 'ok', '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(17, '2.5079E+11', '1513677374', '1111', 'gukubita no gukomeretsa', '', 'Ziberabagabo jean baptiste', 'Kayenzi', '', 'Gabo', '789741641', 'NIYOKWIZERWA Jol', 'Gabo', 'West', 'Karongi', 'Kayenzi', 'Mataba', 'Gikurubuye', '10122017', 'Ubutaka bwe bwose babubaruye nk\'ubw\'ubucuruzi,kandi hariho igice kinini cyo guturaho.Ibi byakozwe n\'ubuyobozi bw\'umudugudu mu ibarura ry\'ubutaka. Afite ikibazo cy\'uko ubukode bwiyongera kandi ubutaka  bwe bwose atari ubw\'ubucuruzi', 'ok', '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(18, '2.5079E+11', '1513677374', '1111', 'gukubita no gukomeretsa', '', 'Habiyambere jean bosco', 'Shyogwe', '', 'Gore', '789741641', 'Mukamusana thaciene', 'Gore', 'South', 'Muhanga', 'Shyogwe', 'Mubuga', 'Rwamaraba', '10122017', 'Turadikanyije isambu,Isambu ye yayiguze numugabo wange bityo kuko tutumvikana akimura imbago afata kubutaka bwange,iyo abayobozi baziteye arongera akazirandura nasubira kurega akantangimbere bakanyita umunyamatiku', 'ok', '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(19, '2.5079E+11', '1513677374', '1111', 'gukubita no gukomeretsa', '', 'Nizeyimana j. Bosco', 'Gacaca', '', 'Gabo', '789741641', 'MBUZUKONGIRA Innocent', 'Gore', 'North', 'Musanze', 'Gacaca', 'Kamasa', 'Burengo', '10122017', 'Izungura hagati y\'umuryango.Ikibazo ni uko umwe abura/ yanga kuza ngo bazungure, bose;bahari nk\'umuryango', 'ok', '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(20, '2.5079E+11', '1513677374', '1111', 'gukubita no gukomeretsa', '', 'Mundere Fabien', 'Musanze', '', 'Gabo', '789741641', 'MUTUYIMANA Valencie', 'Gabo', 'North', 'Musanze', 'Musanze', 'Gacaca', 'Karwasa', '10122017', 'Umuturage yabaruje isambu, abura ibyangombwa 3 byose; by\'amasambu atatu ari mu tugari 2; Kabirizi na Gasakuza mu murenge wa Gacaca', 'ok', '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(21, '2.5079E+11', '1513677374', '1111', 'gukubita no gukomeretsa', '', 'Nduhuyabagabo Sylivestre', 'Rubavu', '', 'Gore', '789741641', 'Mutimutuje Yvette', 'Gabo', 'West', 'Rubavu', 'Rubavu', 'Mbugangari', 'Gasutamo', '10122017', 'Yaguze parcel n,umugabo witwa Djumapili Contact, ahamugurisha kandi hari umugore wa  mbere batandukanye bitemewe n,amategeko, uwo mugore amenye ko Djumapili yahagurishije aza kuburana ubwo butaka bigaragara ko yari abufatanyije na Djumapili umugabo we.', 'ok', '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(22, '2.5079E+11', '1513677374', '1111', 'gukubita no gukomeretsa', '', 'Nsanzamahoro chadrack', 'Muhondo', '', 'Gabo', '789741641', 'Munyempuhwe Ferdinand', 'Gabo', 'North', 'Gakenke', 'Muhondo', 'Gahinga', 'Gahinga', '10122017', 'Ibyangombwa 2 by,ubutaka babihawe ari duplicata. Hari n,Ubundi butaka bwubatseho inzu ataboneye ibyangombwa.', 'ok', '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(23, '2.5079E+11', '1513677374', '1111', 'gukubita no gukomeretsa', '', 'Habiyambere', 'Muhondo', '', 'Gabo', '789741641', 'Uryinanaryo Augustin', 'Gabo', 'North', 'Gakenke', 'Muhondo', 'Gihinga', 'Gihinga', '10122017', 'Yaguze ubutaka ahagenewe ubuhinzi nyamara nta burenganzira abufiteho, nta cyangombwa yahawe cy, aho yaguze,  Kubw, iyo mpamvu nta nguzanyo yahabwa,nta n,umuriro kandi ubutaka butari mu manege.', 'ok', '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(24, '2.5079E+11', '1513677374', '1111', 'gukubita no gukomeretsa', '', 'Devotha Niyodusaba', 'Cyabingo', '', 'Gore', '789741641', 'Kuradusenge Elizabeth', 'Gore', 'North', 'Gakenke', 'Cyabingo', 'Rukora', 'Murehe', '10122017', 'Kuradusenge Elizabeth aregwa na murumuna we Kuradusenge Angella uba muri Kenya ngo nazane amasambu se  yamuhaye yose  ngo bayagabane bushyashya kuko ngo se yamuhaye adahari. Yaregeje urukiko rw,ibanze aratsindwa ajuririra murwisumbuye naho aratsindwa, Yon', 'ok', '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(25, '2.5079E+11', '1513677374', '1111', 'gukubita no gukomeretsa', '', 'Sibomana Louis', 'Kivuruga', '', 'Gabo', '789741641', 'Nsengimana Innocent', 'Gabo', 'North', 'Gakenke', 'Kivuruga', 'Cyintare', 'Buhuga', '10122017', 'Kuba afite ubutaka yabaruje, ariko akaba atarabona icyangombwa cya burundu cy,ubutaka', 'ok', '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(26, '2.5079E+11', '1513677374', '1111', 'gukubita no gukomeretsa', '', 'Ntawanguwe Faustin', 'Kicuruga', '', 'Gabo', '789741641', 'Nzabakurikiza Laurent', 'Gore', 'North', 'Gakenke', 'Kicuruga', 'Cyintare', 'Nyarubuye', '10122017', 'Kuba yarahaye umuhungu we isambu  (gutekesha) maze akayigurana umudugudu wo guturamo, uwo ahahaye ahatekesha abakobwa be 2. Umuhungu we yaje kwimukira mu Muvara,  agiye kugurisha uwo umudugudu nyiraho yifuza ko yahisubiza nawe agasubirana aho yari yaramuh', 'ok', '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(27, '2.5079E+11', '1513677374', '1111', 'gukubita no gukomeretsa', '', 'Nsekambabaye J.claude', 'Kivuruga', '', 'Gabo', '789741641', 'Rwagakiga Jean d,Amour', 'Gore', 'North', 'Gakenke', 'Kivuruga', 'Cyintare', 'Cyintare', '10122017', 'Mu gusohoka kw, ibyangombwa by,ubutaka ntabwo icyangombwa cye kigeme gusohoka,  nyuma yagiye kubaruza ubutaka ntiyabona nomero you, ubutaka ndetse n,icyangombwa cya, ubutaka. Kugeza ubu ntabwo arabona icyangombwa cya burundu.', 'ok', '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(28, '2.5079E+11', '1513677374', '1111', 'gukubita no gukomeretsa', '', 'Twizeyimana Emmanuel', 'Nyamyumba', '', 'Gabo', '789741641', 'Kanamugire Fidele', 'Gore', 'West', 'Rubavu', 'Nyamyumba', 'Rubona', 'Tagaza', '10122017', 'Kuba afite ubutaka bafite icyangombwa cyo gutura, ariko yashatse kubugurisha, bash yizi mu mashini nomero yacyo bamubwira ko ubutaka bwe buri muri zone verte,  none akaba yibaza icyo yakora kugirango abone uburenganzira bwo kugurisha ubwo butaka.', 'ok', '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(29, '2.5079E+11', '1513677374', '1111', 'gukubita no gukomeretsa', '', 'Damascene Dushimyimana', 'Nyundo', '', 'Gabo', '789741641', 'Uwiringiyimana Charles', 'Gabo', 'West', 'Rubavu', 'Nyundo', 'Gatovu', 'Busheru', '10122017', 'Yaguze umurima n,umuntu wapfuye ,nyuma abana be baza kugabana uwo murama. Yaje kugura n,umwe muribo umugabane we none ashaka ku on a icyangombwa cy, ubutaka . Ikibazo kibazo yagishyikirije ubuyobozi bwurubyiruko, Akagari nticyakemuka.', 'ok', '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(30, '2.5079E+11', '1513677374', '1111', 'gukubita no gukomeretsa', '', 'Uwurukundo Ciryake', 'Rugendabari', '', 'Gore', '789741641', 'Mukamurenzi Suzanne', 'Gabo', 'South', 'Muhanga', 'Rugendabari', 'Kanyana', 'Ntonde', '10122017', 'Abantu 2 Twizerimana Andre na Hategekimana Charles bamurange mu rukiko rwose buyer rwa muhanga,  ikirego ntabwo cyakiriwe  n,urubyiruko  ariko Hategekimana yakoresheje irangizarubanza ku muhesha w, inkiko utari uw,umwuga would mu murenge wa Rugendabari hi', 'ok', '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(31, '2.5079E+11', '1513677374', '1111', 'gukubita no gukomeretsa', '', 'Nyirahabimana Dative', 'Mudende', '', 'Gore', '789741641', 'Ntamushobora Elida  (Ruhinguka Chrysologue family)', 'Gabo', 'West', 'Rubavu', 'Mudende', 'Rwanyakayaga', 'Nyamugali', '10122017', 'Ikibazo ni amafaranga y\' inguranwa muri expropriation ya Gishwati yatanzwe muri OP No 990900000/0251/15 mu kagali ka kijote, umurenge wa Bigogwe  habayeho kwibeshya kuri bank aho bayohereje kuri No 996 Sacco Nyakiriba kandi nimero yanjye ari 996 Sacco Mud', 'ok', '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(32, '2.5079E+11', '1513677374', '1111', 'gukubita no gukomeretsa', '', 'Mbyanyehe Innocent', 'Gacaca', '', 'Gabo', '789741641', 'BAZITAKERA Thomas', 'Gabo', 'North', 'Musanze', 'Gacaca', 'Rwasa', 'Kavumu', '10122017', 'Afite ikibazo cy\'uko inzego yagiyemo zose zamwangiye ko ahinduza amazina ari ku cyangombwa cy\'ubutaka; hagati ye n\'uwo baguze.Bamwohereje mu rukiko.Hagati aho urwego yagezeho rwose yabashije kubereka ibyangombwa byose bamusabaga', 'ok', '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(33, '2.5079E+11', '1513677374', '1111', 'ibiyobyabwenge', '', 'Musabimana Speciose', 'Gacaca', '', 'Gabo', '789741641', 'BUNANI Simon', 'Gabo', 'North', 'Musanze', 'Gacaca', 'Gacaca', 'Kabukende', '10122017', 'Afite utujetons gusa. Ariko ntabyangombwa afite, nta na makuru afite y\' ibyangombwa by\' imirima.', 'ok', '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(34, '2.5079E+11', '1513677374', '1111', 'ibiyobyabwenge', '', 'Uwimana J.Nepomuscene', 'Gacaca', '', 'Gabo', '789741641', 'GAHUTU Laurent', 'Gabo', 'North', 'Musanze', 'Gacaca', 'Rwasa', 'Kavumu', '10122017', 'Icyangombwa cyajeho amazina atari aye .Kugeza ubu yabuze igisubizo', 'ok', '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(35, '2.5079E+11', '1513677374', '1111', 'ibiyobyabwenge', '', 'Kaburabuza Pascal', 'Shyogwe', '', 'Gore', '789741641', 'Uzanyinzoga Jeanne', 'Gabo', 'South', 'Muhanga', 'Shyogwe', 'Mubuga', 'Mapfundo', '10122017', 'Umugabo wange yabyaye abana batatu ku nshoreke none abo bana barimo baransaba umunani ku isambu nigabaniye kwa mabukwe kandi barabahaye umunani ku isambu yumuryango.', 'ok', '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(36, '2.5079E+11', '1513677374', '1111', 'ibiyobyabwenge', '', 'Dusabimana J Baptiste', 'Muyongwe', '', 'Gabo', '789741641', 'NKUNDEBANGE Livin', 'Gore', 'North', 'Gakenke', 'Muyongwe', 'Gisiza', 'Muramba', '10122017', 'Noteriasaba amafaranga ( ya notification) abazungura b\'umubyeyi wapfuye. Ibyo ngo kugirango buri mwana wazunguye abone icyangombwa cy\'ubutaka cye kiri mu mazina ye bwite', 'ok', '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(37, '2.5079E+11', '1513677374', '1111', 'ibiyobyabwenge', '', 'Nyirangirumpatse Jacqueline', 'Janja', '', 'Gabo', '789741641', 'Nkundiye Alphonse', 'Gabo', 'North', 'Gakenke', 'Janja', 'Gatwa', 'Gitega', '10122017', 'Umuhungu wanjye Imanirabaruta Eric yabaruje imirima 9 kuri nyina (umugore wanjye wapfuye), none icyangombwa ntibyasohotse , n\' utujeto (UPIs) yaraduhishe, ibibazo nabigejeje ku umuryango arawusuzugura, bigeze ku umurenge ushinzwe ubutaka amutumiza 2 nawe ', 'ok', '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(38, '2.5079E+11', '1513677374', '1111', 'ibiyobyabwenge', '', 'Bizamambu Andre', 'Muyongwe', '', 'Gore', '789741641', 'MUKANDENGO Languida', 'Gabo', 'North', 'Gakenke', 'Muyongwe', 'Karyango', 'Mugera', '10122017', 'Mukandengo Languida yaguze isanbu  aranayandikisha mu rukiko. Nyuma uwo bayiguze yaje kuyimwaka,akoresheje impapuro mpimbano. Avuga ko baburanye, hanyuma Languida aratsindwa; ndetse na nyuma y\'aho hajemo n\'urugomo', 'ok', '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(39, '2.5079E+11', '1513677374', '1111', 'ibiyobyabwenge', '', 'Barasimbwa Jean de Dieu', 'Muyongwe', '', 'Gabo', '789741641', 'BAZAMANZA Felicien', 'Gabo', 'North', 'Gakenke', 'Muyongwe', 'Karyango', 'Kibingo', '10122017', 'Hari ubutaka uyu BAZAMANZA atarabuje kubera ko yari arwaye. Igice cy\'ubwo butaka butabarujwe, undi muntu yabwibarujeho(ishyamba); ndetse hari n\'ikibanza kirimo inzu bibarujeho.', 'ok', '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(40, '2.5079E+11', '1513677374', '1111', 'ibiyobyabwenge', '', 'Baragahoranye Jean Paul', 'Kanzenze', '', 'Gabo', '789741641', 'BIZIMANA Charles', 'Gabo', 'West', 'Rubavu', 'Kanzenze', 'Kirerema', 'Bisesero', '10122017', 'Amafaranga y\'inguranwe atabonye ku murima uherereye mu gishwati bitewe nuko konti y\'abaturage yari yaratanze yari yarafunzwe. Nyuna yaje gufunguza indi ariko na n\' ubu ntarayabona.Yagiye no muri BNR bamubwira ko amafaranfa yagarutse kuri konti ifunze', 'ok', '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(41, '2.5079E+11', '1513677374', '1111', 'ibiyobyabwenge', '', 'Mukamusoni Stephanie', 'Minazi', '', 'Gore', '789741641', 'AKITEGETSE Florida', 'Gore', 'North', 'Gakenke', 'Minazi', 'Murambi', 'Nyarubuye', '10122017', 'Abana bagabanye isambu basigiwe n\'umubyeyi wabo amaze gupfa; none buri wese uko ari batanu ( 5) arashaka kubona icyangombwa cye. Ubu icyangombwa cyanditse kuri umwe ( mukuru wabo) witwa MUKESHIMANA.', 'ok', '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(42, '2.5079E+11', '1513677374', '1111', 'ibiyobyabwenge', '', 'Kakuze Daniel', 'Kimonyi', '', 'Gore', '789741641', 'Mukarurema Florence', 'Gore', 'North', 'Musanze', 'Kimonyi', 'Buramira', 'Kamugeni', '10122017', 'Mukarurema Florence avuga ko isambu yumuryango ahagarariye yatishishijwe na se atarapfa akayatisha ngiruwonsanga umuryango utabizi none mukarurema ajya guhinga mumurima wabo ngiruwonsanga akamwirukana', 'ok', '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(43, '2.5079E+11', '1513677374', '1111', 'ibiyobyabwenge', '', 'Rwandarugari Vincent', 'Minazi', '', 'Gabo', '789741641', 'NIYONAMBA Potien', 'Gabo', 'North', 'Gakenke', 'Minazi', 'Munyana', 'Kanka', '10122017', 'Naguze isambu ifite icyangombwa; nguraho igice sinabona icyangombwa cyanjye kubera nabonye kubikoresha bihenze cyane kandi na serivise  ziri kure', 'ok', '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(44, '2.5079E+11', '1513677374', '1111', 'ibiyobyabwenge', '', 'Mwiseneza Anastase', 'Minazi', '', 'Gabo', '789741641', 'TUYISHIMIRE Baptiste', 'Gabo', 'North', 'Gakenke', 'Minazi', 'Munyana', 'Kanka', '10122017', 'Naguze ubutaka none twabuze uko tubusatura ngo buri wese abone icyangombwa cye. Birahenze kandi serivise ziri kure', 'ok', '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(45, '2.5079E+11', '1513677374', '1111', 'ibiyobyabwenge', '', 'Muhawenimana pelagie', 'Kinazi', '', 'Gabo', '789741641', 'TWAGIRINSHUTI Vdaste', 'Gabo', 'North', 'Gakenke', 'Kinazi', 'Munyana', 'Nyabitare', '10122017', 'Naguze igice kimwe cy\'ubutaka,ubundi busigarana nyirabwo. Twagiye guhinduza ngo mbone icyangombwa cyanjye nsanga birahenze cyane.', 'ok', '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(46, '2.5079E+11', '1513677374', '1111', 'ibiyobyabwenge', '', 'Ngarambe Mathias', 'Rubavu', '', 'Gabo', '789741641', 'Nzaryicyompawe Salim', 'Gore', 'West', 'Rubavu', 'Rubavu', 'Gikombe', 'Rebero', '10122017', 'Naguze ubutaka na Nzabonimpa iyeze,  icyo gihe ntacyangombwa cyubwo butaka yari afite gusa yari afite gitansi  , agiye kwireba  aribura mubazafata ibyangombwa,bamwohereza kukarere tugezeyo baratubwira bazadutumiriza. Nyuma dusubirayo baratubwira ngo cyara', 'ok', '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(47, '2.5079E+11', '1513677374', '1111', 'ibiyobyabwenge', '', 'Niyonsaba J Baptiste', 'Minazi', '', 'Gabo', '789741641', 'NDAGIWENIMANA Jacques', 'Gabo', 'North', 'Gakenke', 'Minazi', 'Murambi', 'Nyarubuye', '10122017', 'Nagurishije igice cy\'ubutaka; none twagiye gukoresha ikindi cyangombwa cy\'uwo twaguze; batubwira ko bidashoboka. Ubutaka bwanditse ko ari ubw\'ubuhinzi, kandi buri wese akeneye icyangombwa cye', 'ok', '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(48, '2.5079E+11', '1513677374', '1111', 'ibiyobyabwenge', '', 'Uwizeyimana Robert', 'Kinigi', '', 'Gore', '789741641', 'Mukarukundo', 'Gabo', 'North', 'Musanze', 'Kinigi', 'Nyonirima', 'Nyagisenyi', '10122017', 'Ikibazo mfite ni umuturanyi twadikanyije ahora yimura imbago idutandukanya,none kugeza ubu aho twakira dutandukaniye yaranduye ibiti byarimo ashyiraho uruzitiro rw\' imbaho', 'ok', '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(49, '2.5079E+11', '1513677374', '1111', 'ubujura', '', 'Nizeyimana Reverien', 'Ruli', '', 'Gabo', '789741641', 'TWAGIRIYAREMYE Aloys', 'Gore', 'North', 'Gakenke', 'Ruli', 'Ruli', 'Mugambazi', '10122017', 'Ikibazo afite ni uko icyangombwa cye cyanditseho imiturire.Ibi bituma bamusoresha amafaranga ya buri mwaka  kandi abandi baturanye badasora( hatanditseho imiturire). Arasabwa kurenganurwa.', 'ok', '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(50, '2.5079E+11', '1513677374', '1111', 'ubujura', '', 'Mutarambirwa Vianney', 'Ruli', '', 'Gore', '789741641', 'KIYENDEYE Laurence', 'Gabo', 'North', 'Gakenke', 'Ruli', 'Gikingo', 'Kabingo', '10122017', 'Uyu muturage asoreshwa amafaranga kandi arumukene. Ikibazo yakijeje ku murenge ariko ntikirakemuka. Bamwijeje ko bagiye kumukorera ubuvugizi ariko ntacyakozwe.ntiyishoboye kandi bamubwira ko bazamugurishiriza cyamunara', 'ok', '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(51, '2.5079E+11', '1513677374', '1111', 'ubujura', '', 'Nzigira Anastase', 'Ruli', '', 'Gore', '789741641', 'KARUGENDO Plagie', 'Gabo', 'North', 'Gakenke', 'Ruli', 'Ruli', 'Mugambazi', '10122017', 'Umukecuru witwa Mukamutoni yaburanye na Mpagazehe ishyamba.Mpagazehe yaje kumutsinda,ariko icyangombwa cyari cyanditseho KARUGENDO Plagie, kuko mukubaruza bari bafatanije icyangombwa kuberako badikanije ubutaka. Karugendo ashaka guhinduza buri wese akagi', 'ok', '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(52, '2.5079E+11', '1513677374', '1111', 'ubujura', '', 'Mutuyimana Christine', 'Coko', '', 'Gabo', '789741641', 'KURUTABARE Alphonse', 'Gabo', 'North', 'Gakenke', 'Coko', 'Nyanza', 'Baramba', '10122017', 'Ubutaka bukatwamo imidugudu, nyirabwo KURUTABARE yarafunze. Abandi bantu babwiyandikishaho batamwishyuye, nta n\'ingurane bamuhaye', 'ok', '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(53, '2.5079E+11', '1513677374', '1111', 'ubujura', '', 'Maniragaba Narcisse', 'Coko', '', 'Gore', '789741641', 'MANIRARINDA Placde', 'Gabo', 'North', 'Gakenke', 'Coko', 'Kiruku', 'Buhuri', '10122017', 'Ni ubutaka bukomoka kw\'izungura asangiye n\'abavandimwe be ariko kugeza ubu kubwandikisha byaranze. Barasabwa attestation de dc ya mama wabo(icyemezo kigaragaza ko yitabye Imana) mu 1979; kandi kuyibona birakomeye cyane bitewe n\'uko dossiers zari mu mako', 'ok', '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(54, '2.5079E+11', '1513677374', '1111', 'ubujura', '', 'Tuyishimire Anaclet', 'Shyogwe', '', 'Gore', '789741641', 'Uzanyinzoga Jeanne', 'Gore', 'South', 'Muhanga', 'Shyogwe', 'Mubuga', 'Mapfundo', '10122017', 'Umugabo yabyaye abana 3 ku nshoreke none bari kumusaba umunani mu isambu yigabaniyekwa nyirabukwe. Bo bari barabahaye iminani mu isambu y,umuryango. Akaba yifuza ko banana ibyo babahaye nawe akazana aho afite  noneho bakahagabana uko ari 7 (abana 4 na ba ', 'ok', '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(55, '2.5079E+11', '1513677374', '1111', 'ubujura', '', 'Bigirimana Protais', 'Shyogwe', '', 'Gore', '789741641', 'Mukamusana Thacienne', 'Gabo', 'South', 'Muhanga', 'Shyogwe', 'Mubuga', 'Rwamaraba', '10122017', 'Kuba hari abo badikanyije isambu bakaba barayiguze n,umugabo we bityo kuko batumvikana bakemura imbago bafata mukwe, yahamagara abayobozi, bakaza bagatera imbago aho zikwiye, iyo hashize iminsi back baturanyi baraza bakazirandura, yasubira kurega, bakamut', 'ok', '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(56, '2.5079E+11', '1513677374', '1111', 'ubujura', '', 'Ndagijimana Petero', 'Muzo', '', 'Gore', '789741641', 'Akimanizanye Florence', 'Gore', 'North', 'Gakenke', 'Muzo', 'Kabatezi', 'Runyinya', '10122017', 'Ubutaka bwari ubw\' ababyeyi; umushinga CYGANDE uteramo ibiti ku masezerano y\'imyaka 30. Bitewe n\'uko ubu butaka bwatikanije n\'ubwa Leta; bwabarujwe kuri Leta mugihe kibarura. Bamuhaye agapapuro,bamubwira kuzabihinduza; ariko agiyeyo baranga. Arifuza ko ub', 'ok', '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(57, '2.5079E+11', '1513677374', '1111', 'ubujura', '', 'Hategekimana Amiel', 'Busogo', '', 'Gabo', '789741641', 'Niyonzima Jean de Dieu', 'Gore', 'North', 'Musanze', 'Busogo', 'Sahara', 'NA', '10122017', 'NIYONZIMA Jean de Dieu yahinze ubutaka bwe agerekaho n\'ubutari ubwe ( arabubohoza), afite gahunda yo kubugira ubwe.Ubuyobozi bwakigiyemo, bufata umwanzuro ko kigomba gukemukira mu nteko y\'abaturage', 'ok', '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(58, '2.5079E+11', '1513677374', '1111', 'ubujura', '', 'Mukurarinda J Damascene', 'Mataba', '', 'Gore', '789741641', 'MUKANKURANKA Flicit', 'Gabo', 'North', 'Gakenke', 'Mataba', 'Gikombe', 'Gashyushya', '10122017', 'Uyu mubyeyi avuga ko afite isambu  yari irimo inzu,imyaka ihinzemo ndetse n\'urutoki. Umushinga wo gukwirakwiza amashanyarazi ( REG) waje gucishamo umuyoboro wabo; biba ngombwa ko bamuhagarika, bumvikana ko bazamuha ingurane. Ariko kugeza n\'ubu ntibarayimu', 'ok', '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(59, '2.5079E+11', '1513677374', '1111', 'ubujura', '', 'Ndayambaje JMV', 'Cyuve', '', 'Gabo', '789741641', 'NTEZIMANA Vincent', 'Gabo', 'North', 'Musanze', 'Cyuve', 'Cyanya', 'Kibande', '10122017', 'Umuturage witwa KAMANZI  Cyiza yareze NTEZIMANA vincent n\'abagenzi be aribo: DUSABIMANA, MUNYANKERA, MUNYENGABE, AHORINYUZE, MUNYAMASHARA na GAHAMANYI. Aba bose baregwaga isaranganya.  KAMANZI Cyiza yaje gutsindwa;mu rukiko rw\'ibanze rwa Muhoza. Ikibazo n', 'ok', '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(60, '2.5079E+11', '1513677374', '1111', 'ubujura', '', 'Ndayambaje Jean Marie Vianney', 'Cyuve', '', 'Gabo', '789741641', 'NKURUNZIZA Abel', 'Gore', 'North', 'Musanze', 'Cyuve', 'Cyanya', 'Kayange', '10122017', 'NKURUNZIZA Abel yaguze isambu/umurima na Bavuga/NSENGIYUMVA Lonard. Iyo Sambu yagurishijwe na NSENGIYUMVA, yari intekeshwa yahawe na se; MIkEKEMO; ariko ikaba yarabarujwe na  NIZEYIMANA Pauline, umwuzukuru wa Mikekemo; kuberako umuhungu wa MIKEKEMO;Lona', 'ok', '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(61, '2.5079E+11', '1513677374', '1111', 'ubujura', '', 'Nsanzimana Jean Claude', 'Cyuve', '', 'Gabo', '789741641', 'NKURUNZIZA Abel', 'Gore', 'North', 'Musanze', 'Cyuve', 'Cyanya', 'Kayange', '10122017', 'NKURUNZIZA yaguze umurima/isambu na se wabo; NSENGIYUMVA Lonard (Bavuga). Uyu Lonard akaba ari umuhungu wa Mikekemo; nyiri iyi sambu. Ariko icyangombwa cy\'ubutaka kikaba cyanditse kuri NIZEYIMANA Pauline; umwuzukuru wa Mikekemo.Mikekemo amaze gupfa,baga', 'ok', '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(62, '2.5079E+11', '1513677374', '1111', 'ubujura', '', 'Mbanzarugo David', 'Cyuve', '', 'Gore', '789741641', 'NYIRABARERA Anastasie', 'Gore', 'North', 'Musanze', 'Cyuve', 'Cyanya', 'Kibande', '10122017', 'tfgxj', 'ok', '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(63, '2.5079E+11', '1513677374', '1111', 'ubujura', '', 'Ndayizeye J de Dieu', 'Cyuve', '', 'Gore', '789741641', 'BANGANIRUBUSA Velena', 'Gore', 'North', 'Musanze', 'Cyuve', 'Buruba', 'Bazizana', '10122017', 'Umurima wa BANGANIRUBUSA  Velena wadikanije n\'uwa KABARAGASA. Uyu Kabaragasa yaje kwibaruzaho umurima wa Velena; awufatanya n\'uwe.Kugeza ubu Banganirubusa Velena nta cyangombwa cy\'ubutaka arabona. Ikibazo gikomereye Banganirubusa kuko niyo batumije Kabara', 'ok', '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(64, '2.5079E+11', '1513677374', '1111', 'ubujura', '', 'Nsanzumuhire', 'Cyuve', '', 'Gabo', '789741641', 'NKURUNZIZA Abel', 'Gore', 'North', 'Musanze', 'Cyuve', 'Cyanya', 'Kayange', '10122017', 'NKURUNZIZA Abel, NZABANDORA Emmanuel,NAYITURIKI Mathias, BAMVURA na NTAMUKUNZI Purisikira ; baguze umurima na Bavuga/NSENGIYUMVA Lonard mwene Mikekemo. Iyo sambu yagurishijweho ibarujweho NIZEYIMANA Pauline,umwuzukuru wa Mikekemo,akaba ari nawe ufite icy', 'ok', '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(65, '2.5079E+11', '1513677374', '1111', 'ubutaka', 'imbibi', 'Munyandamutsa Marcelline', 'Nkotsi', '', 'Gabo', '789741641', 'KAREKEZI Flicien', 'Gabo', 'North', 'Musanze', 'Nkotsi', 'Bikaka', 'Kindiki', '10122017', 'Nabaruje umurima icyangombwa cyanjye nticyasohoka.', 'ok', '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(66, '2.5079E+11', '1513677374', '1111', 'ubutaka', 'kwandikisha ', 'Samuel Habiyaremye', 'Gashenyi', '', 'Gore', '789741641', 'MUKAMAZIMPAKA Sraphine', 'Gore', 'North', 'Gakenke', 'Gashenyi', 'Taba', 'Gihanga', '10122017', 'Nta cyangombwa cyasohotse. Banditse ko ari igishanga,kandi hirya no hino hatuwe', 'ok', '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(67, '2.5079E+11', '1513677374', '1111', 'ubutaka', 'guhererekanya', 'Mugorewabega marthe', 'Gashenyi', '', 'Gabo', '789741641', 'NTAWIHEBA Clestin', 'Gabo', 'North', 'Gakenke', 'Gashenyi', 'Rutenderi', 'Kibara', '10122017', 'Kugaragaza imbibi z\'ubutaka bwa Leta n\'ubwa NTAWIHEBA Clstin', 'ok', '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(68, '2.5079E+11', '1513677374', '1111', 'ubutaka', 'kwimurwa ku nyungu rusange', 'Harerimana jean claude', 'Gashenyi', '', 'Gabo', '789741641', 'MPAMAGARANDE', 'Gabo', 'North', 'Gakenke', 'Gashenyi', 'Taba', 'Gasharu', '10122017', 'Ikibazo cyo kuzungura ubutaka bw\'umwana we witabye Imana', 'ok', '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(69, '2.5079E+11', '1513677374', '1111', 'ubutaka', 'izungura', 'Twagiramungu Gaspard', 'Shingiro', '', 'Gabo', '789741641', 'Ntahomvukiye Anastase', 'Gore', 'North', 'Musanze', 'Shingiro', 'Gakingo', 'Burengo', '10122017', 'Ntahomvukiye Anastase afite ikibazo cy, uko yaguze isambu n,uwitwa Kananutsi Theogene guha iyo sambu yari yaragenewe gahinga. Ntahomvukiye yaguzeho agace gato ko guturamo, gusa ikibazo afite ni uko ashaka kubaka agahinduza aka gace gato yaguze icyari guhi', 'ok', '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(70, '2.5079E+11', '1513677374', '1111', 'ubutaka', 'imikoreshereze y ubutaka ', 'Kagwa hassan', 'Shingiro', '', 'Gabo', '789741641', 'Bisanukuri Theoneste', 'Gabo', 'North', 'Musanze', 'Shingiro', 'Gakingo', 'Gasura', '10122017', 'Uyu Bisanukuri Theoneste yaguze ubutaka na Nyirandahari Velediane,  icyangombwa cye cyari cyanditseho Verediane n,umugabo we gusa umugabo we yaje kwitaba Imana guhinduriza Bisanukuri Theoneste ngo bakore ihererekanyabubasha biranga bitewe n,uko nyakwigend', 'ok', '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(71, '2.5079E+11', '1513677374', '1111', 'ubutaka', 'imbibi', 'Bizimana Jean Berchmas', 'Rushashi', '', 'Gabo', '789741641', 'SINDAYIGAYA James', 'Gabo', 'North', 'Gakenke', 'Rushashi', 'Joma', 'Rugarama', '10122017', 'Yashatse umugore w\'umunyamahanga (Congo) ntibasezerana. Yasabye icyangombwa cy\'ubutaka, bamubwira ko atakibona kubera yamwibarujeho batarasezeranye. Arasaba ko umugore bamukuraho agasigara wenyine, kugirango abashe kubona icyangombwa', 'ok', '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(72, '2.5079E+11', '1513677374', '1111', 'ubutaka', 'kwandikisha ', 'Rubayiza Innocent', 'Rushashi', '', 'Gabo', '789741641', 'Havugimana Diogne', 'Gabo', 'North', 'Gakenke', 'Rushashi', 'Shyombwe', 'Gatwa', '10122017', 'Ubutaka bwari bwarabaruwe nk\'igishanga kandi ari i musozi. Baje guhindura bubarurwa nk\'ubw\'imusozi; ariko ntibamuha icyangombwa. N\'ubwo afite agapapuro kerekana ko bwabaruwe, nta cyangombwa arabona.', 'ok', '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(73, '2.5079E+11', '1513677374', '1111', 'ubutaka', 'guhererekanya', 'Niyibizi Felex', 'Rushashi', '', 'Gore', '789741641', 'NTAMITONDERO Lucie', 'Gore', 'North', 'Gakenke', 'Rushashi', 'Joma', 'Nyagasozi', '10122017', 'Lucie yashatse mu buryo butemewe n\'amategeko, abyarana umwana n\'uwo bashakanye. Umugabo amaze gupfa,isambu bayanditse ku mwana. Umwana akuze,yaje guhabwa umunani. Nibwo bategetse nyina, Lucie,kumuha ubutaka bwose n\'icyangombwa cyabwo.Lucie ntiyigeze abyis', 'ok', '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(74, '2.5079E+11', '1513677374', '1111', 'ubutaka', 'kwimurwa ku nyungu rusange', 'Nkurikiyimana Felecien', 'Rushashi', '', 'Gore', '789741641', 'MUKANKWIYE Marie', 'Gore', 'North', 'Gakenke', 'Rushashi', 'Burimba', 'Kara', '10122017', 'Marie yaguze ubutaka bufite icyangombwa. Bagiye guhinduza ku karere(niho byakorerwaga), bamwizeza ko icyangombwa bazacyohereza kuko yatanze ibisabwa byose. Yarategereje arakibura; asubirayo asanga cyiracyanditse kuwo baguze. Bamutegetse gushaka uwo baguze', 'ok', '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(75, '2.5079E+11', '1513677374', '1111', 'ubutaka', 'izungura', 'Musafiri Etienne', 'Rushashi', '', 'Gabo', '789741641', 'HABIYAKARE Valens', 'Gore', 'North', 'Gakenke', 'Rushashi', 'Burimba', 'Kara', '10122017', 'Icyangombwa bagisohoye cyanditse nabi.Mukubigarura bavuye kubikosora, icya Laurence kirabura,kandi bafite numero. Ubu, ubuyobozi bugaragaza ko ubwo butaka butigeze bubaho, kandi umuturage afite numero yabwo, kandi nabwo burahari', 'ok', '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(76, '2.5079E+11', '1513677374', '1111', 'ubutaka', 'imikoreshereze y ubutaka ', 'Musonera Jean', 'Minazi', '', 'Gabo', '789741641', 'NDACYAYISENGA Alfred', 'Gabo', 'North', 'Gakenke', 'Minazi', 'Gasiho', 'Gahombo', '10122017', 'Yagiranye ikibazo na bishywa be, bahawe umugabane badahari. Aho baziye, banze aho umuryango wabageneye. Bahisemo aha Nyirarume. Ariko ubutaka niwe bwanditseho.', 'ok', '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(77, '2.5079E+11', '1513677374', '1111', 'ubutaka', 'imbibi', 'Mukamana Elinah', 'Minazi', '', 'Gore', '789741641', 'HABUMUGISHA Innocent', 'Gore', 'North', 'Gakenke', 'Minazi', 'Raba', 'Sarabuye', '10122017', 'Ubutaka bwaguzwe n\'abantu babiri; bugurwa nyuma y\'ibarura ry\'ubutaka. Mu gihe cyo kubwandikisha, basobanurirwa ko amazina yabo yandikwa ku cyangombwa kimwe. Ntibabashije kubyumvikanaho; basaba ko buri wese yahabwa icyangombwa cye. Ariko bababwiye ko bidas', 'ok', '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(78, '2.5079E+11', '1513677374', '1111', 'ubutaka', 'kwandikisha ', 'Nsabimana damascene', 'Nyange', '', 'Gabo', '789741641', 'MUSEMGIMANA Jean Claude', 'Gore', 'North', 'Musanze', 'Nyange', 'Kabeza', 'Rwebeya', '10122017', 'Dufite ubutaka buri ku muhanda w\'ubukerarugendo. Bari batubwiye ko tugomba gusiga metero 22 (22m), uvuye ku kibanza. Ubuyobozi bw\'umurenge bwandikiye akarere busaba ko izo metero zagabanywa. Twategereje ko akarere kadusubiza, amaso ahera mu kirere', 'ok', '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(79, '2.5079E+11', '1513677374', '1111', 'ubutaka', 'guhererekanya', 'Mwita jean', 'Murundi', '', 'Gabo', '789741641', 'SIBOMANA Augustin', 'Gore', 'West', 'Karongi', 'Murundi', 'Nzaratsi', 'NYAMABUYE', '10122017', 'SIBOMABA Augustin yaguze ubutaka na HABYALIMANA Prince, wari SEDO w\'akagari ka Mubuga. Habyalimana nawe yari yarabuguze na MUKABWANA Josephine; wabugurishije atarabona icyangombwa.Nyuma yo kugurisha yahise yimukira mukandi kagari.Ikibazo yanze kuza guhind', 'ok', '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(80, '2.5079E+11', '1513677374', '1111', 'ubutaka', 'kwimurwa ku nyungu rusange', 'Nkurikiyinka felicien', 'Ruganda', '', 'Gabo', '789741641', 'HABARUGIRA Uziel', 'Gabo', 'West', 'Karongi', 'Ruganda', 'Rubona', 'Maryohe', '10122017', 'Ni ubutaka avuga ko yasigiwe na se wabo utuye mu Bugesera. Abyutsa ikibazo gusa iyo bahinduye umuyobozi w\'akagari cyangwa uw\'umurenge', 'ok', '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(81, '2.5079E+11', '1513677374', '1111', 'ubutaka', 'izungura', 'Mugabangira elias', 'Ruganda', '', 'Gore', '789741641', 'MUKAGASANA Yulida', 'Gore', 'West', 'Karongi', 'Ruganda', 'Nyamugwagwa', 'Nyamugwagwa', '10122017', 'Bategereje ko icyangombwa gisohoka. Mu iraga bamuhaye hato none  ari kwiyenza kubahawe hanini', 'ok', '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(82, '2.5079E+11', '1513677374', '1111', 'ubutaka', 'imikoreshereze y ubutaka ', 'Mugabangira elias', 'Nyarusange', '', 'Gabo', '789741641', 'NTEZIYAREMYE Onesphore', 'Gabo', 'South', 'Muhanga', 'Nyarusange', 'Rusovu', 'Rwambariro', '10122017', 'NTEZIYAREMYE Onesphore yagurishije ikibanza, ariko ntiyahagurisha hose. Yaje kugira ikibazo ibyangombwa by\'ubutaka bitangwa afunze; ndetse n\'ahasigaye hagenderamo. NSHUTIYIMANA Sylveni arashaka kuhikubira hose, yitwaje ko ari we ufite icyangombwa cy\'ubwo ', 'ok', '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(83, '2.5079E+11', '1513677374', '1111', 'ubutaka', 'imbibi', 'Bugingo Emmanuel', 'Nyarusange', '', 'Gabo', '789741641', 'NZABAMWITA Ephrem', 'Gore', 'South', 'Muhanga', 'Nyarusange', 'Rusovu', 'Rwambariro', '10122017', 'NZABAMWITA Ephrem yaguze umurima urimo ishyamba awugura na Protais. Uwo murima Protais yari yarawuguze na mushiki we Lucie; igihe umugabo wa Lucie atabaga mu rugo. Lucie yaje kubura amafaranga yo kurihira abana ishuri, biba ngombwa ko awugurisha. None umu', 'ok', '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(84, '2.5079E+11', '1513677374', '1111', 'ubutaka', 'kwandikisha ', 'Bizimungu Jean Pierre', 'Karambo', '', 'Gabo', '789741641', 'MUHIRE Faustin', 'Gore', 'North', 'Gakenke', 'Karambo', 'Kanyanza', 'Kabutare', '10122017', 'Ubutaka bwaguzwe, ntihandikwa icyangombwa cy\'uwabuguze, kandi uwabugurishije yimukiye mu yindi ntara', 'ok', '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(85, '2.5079E+11', '1513677374', '1111', 'ubutaka', 'guhererekanya', 'Iradukunda Jeannine', 'Karambo', '', 'Gabo', '789741641', 'NTAKIRUTIMANA Innocent', 'Gabo', 'North', 'Gakenke', 'Karambo', 'Kirehe', 'Bukunga', '10122017', 'Ni amakimbirane ashingiye ku muyoboro w\'amazi ( umugenda), uri hagati y\'umurima', 'ok', '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(86, '2.5079E+11', '1513677374', '1111', 'ubutaka', 'kwimurwa ku nyungu rusange', 'Ndayisenga Donat', 'Mudende', '', 'Gabo', '789741641', 'SIKPEMZWE Jean Claude', 'Gabo', 'West', 'Rubavu', 'Mudende', 'Rwanyakayaga', 'Nyamugari', '10122017', 'Nabaruje ubutaka bwanjye , bampa gitansi, nyishyura amafaranga igihumbi( 1000). Ariko, icyangombwa nticyasohokana n\'ibindi.Nabajije kumurnge bambwira ko barabikurikirana.Kugeza ubu nta gisubizo ndabona. Gitansi n\'ibindi byangombwa bansabye barabijyanye.', 'ok', '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(87, '2.5079E+11', '1513677374', '1111', 'ubutaka', 'izungura', 'Mugabo J Bosco', 'Janja', '', 'Gore', '789741641', 'Mukaruziga chantal', 'Gore', 'North', 'Gakenke', 'Janja', 'Gatwa', 'Nyagisozi', '10122017', 'Umugabo yabaruje amasambu abiri yanga kuyanyandikishaho kandi twarasezeranye', 'ok', '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(88, '2.5079E+11', '1513677374', '1111', 'ubutaka', 'imikoreshereze y ubutaka ', 'Ntirenganya Papias', 'Ruheru', '', 'Gore', '789741641', 'Kabarinda', 'Gabo', 'South', 'Nyaruguru', 'Ruheru', 'Gitita', 'Nyacyonga', '10122017', 'Yampaye isambu ankwerera none ariho arahanyambura ngo mve muri urwo rugo nabana Maze abuhe undi mugore we muto witwa  simugomwa Sarah .', 'ok', '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(89, '2.5079E+11', '1513677374', '1111', 'ubutaka', 'imbibi', 'Habineza Marian', 'Kanyinya', '', 'Gabo', '789741641', 'Rwagashaija Isaac', 'Gore', 'Kigali', 'Nyarugenge', 'Kanyinya', 'Taba', 'Nyarusange', '10122017', 'Akarere ka Nyarugenge kantwariye ubutaka kubuntu batangira kubukoreraho ibikorwa bimwe na bimwe batanyishuye banyangiriza imyaka', 'ok', '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(90, '2.5079E+11', '1513677374', '1111', 'ubutaka', 'kwandikisha ', 'Musabyemariya Immaculee', 'Rusasa', '', 'Gabo', '789741641', 'Nzabonimpa Alphonse', 'Gabo', 'North', 'Gakenke', 'Rusasa', 'Gataba', 'Gataba', '10122017', 'Uwitwa Bazita yarandengereye andimburira ibiti kdi biri mu butaka bwanjye', 'ok', '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(91, '2.5079E+11', '1513677374', '1111', 'ubutaka', 'guhererekanya', 'Kabalisa Alexis', 'Mushishiro', '', 'Gore', '789741641', 'Muragijemariya Alphonsine', 'Gore', 'South', 'Muhanga', 'Mushishiro', 'Munazi', 'Kabare', '10122017', 'Muragijemariya Alphonsine yareze se wabo Turatsinze Joseph ko atabahaye ingarigari yari yategetswe n\' inteko y\' abunzu aho kuyibaha arayigabanya.', 'ok', '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(92, '2.5079E+11', '1513677374', '1111', 'ubutaka', 'kwimurwa ku nyungu rusange', 'Mubiligi Sept', 'Gashenyi', '', 'Gore', '789741641', 'Mugiraneza Edison', 'Gore', 'North', 'Gakenke', 'Gashenyi', 'Taba', 'Mwisha', '10122017', 'Data yantekesheje ubutaka none ntacyangombwa cyabwo mfite kuko bavuga ko ubutaka butarengeje hegitare (ha) budacibwamo ibice', 'ok', '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(93, '2.5079E+11', '1513677374', '1111', 'ubutaka', 'izungura', 'Munyengabe Eugene', 'Gashenyi', '', 'Gore', '789741641', 'Uwimana Julienne', 'Gore', 'North', 'Gakenke', 'Gashenyi', 'Rutenderi', 'Murambo', '10122017', 'Umugabo witwa Nzikunyurwa frodouard arashaka kumpuguza ubutaka natekeshejwe na Databukwe Nkizinkiko', 'ok', '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(94, '2.5079E+11', '1513677374', '1111', 'ubutaka', 'imikoreshereze y ubutaka ', 'Havugiyaremye Felix', 'Ndera', '', 'Gabo', '789741641', 'Mugabarigira Augustin', 'Gore', 'Kigali', 'Gasabo', 'Ndera', 'Kibenga', 'Rugazi', '10122017', 'Umugabo Habiyaremye yaraje yihariye ubutaka bwanjye, aho mbiboneye Njyanama ku urega tuburana mu bunzi, ndamutsinda bamusaba kunsubiza ubutaka bwanjye, aho kubunsubiza ajurira ku munsi wo kubumpa.', 'ok', '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(95, '2.5079E+11', '1513677374', '1111', 'ubutaka', 'imbibi', 'Habimana Geoffrey', 'Mushikiri', '', 'Gore', '789741641', 'Tuyishimire Clemence', 'Gore', 'East', 'Kirehe', 'Mushikiri', 'Rwanyamuhanga', 'Bweramana', '10122017', 'Yambuwe ubutaka bw\'ababyeyi na se wabo kuko yamwihakanye ngo ntabwo amuzi', 'ok', '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(96, '2.5079E+11', '1513677374', '1111', 'ubutaka', 'kwandikisha ', 'Kayitare Bosco', 'Buramira', '', 'Gabo', '789741641', 'KAMANUTSI Theresphore', 'Gabo', 'North', 'Musanze', 'Buramira', 'Kimonyi', 'Kamugeni', '10122017', 'Kamanutsi avuga ko yahaye abana be bose ubutaka; by\'agateganyo, yiteganyiriza ejo hazaza. Abo bana bari bahagarariwe na nyina; UWIMANA Eugnie; none bari no kumpata bashaka kubyibaruzaho ku ngufu', 'ok', '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(97, '2.5079E+11', '1513677374', '1111', 'ubutaka', 'guhererekanya', 'Ndayisenga Donat', 'Nkotsi', '', 'Gore', '789741641', 'NSENGIYAREMYE Jean Bosco', 'Gabo', 'North', 'Musanze', 'Nkotsi', 'Bikara', 'Kindiki', '10122017', 'Narabaruje, icyangombwa nticyasohoka.Nta n\'akajeton nabonye', 'ok', '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(98, '2.5079E+11', '1513677374', '1111', 'ubutaka', 'kwimurwa ku nyungu rusange', 'Mukashema Florence', 'Cyanzarwe', '', 'Gabo', '789741641', 'Ntiruhongerwa Pascal', 'Gabo', 'West', 'Rubavu', 'Cyanzarwe', 'Ruhugara', 'Kanyamagare', '10122017', 'Uyu Ntiruhongerwa Pascal yarapfakaye  ashakana n\'undi mugore. Abana b\'umugore wa mbere bavuga ko isambu atagomba kuyibonaho, kuko ari iy\'umubyeyi wabo yariye, ko aribo bazungura ba nyina', 'ok', '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(99, '2.5079E+11', '1513677374', '1111', 'ubutaka', 'izungura', 'Uwingabire Hycinthe', 'Kanzenze', '', 'Gore', '789741641', 'Nyiragisenyi Josephine', 'Gabo', 'North', 'Rubavu', 'Kanzenze', 'Kirerema', 'Kirerema', '10122017', 'Batuje abantu ba kure mu gishwati; babatuje mu kwanjye , bampa ingurane ntoya, itangana n\'aho bantwaye batuza abaturage.Sinabyishimiye', 'ok', '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(100, '2.5079E+11', '1513677374', '1111', 'ubutaka', 'imikoreshereze y ubutaka ', 'Ndagijimana Jean Baptiste', 'Mataba', '', 'Gabo', '789741641', 'TUGIRIMANA Viateur', 'Gabo', 'North', 'Gakenke', 'Mataba', 'Gikombe', 'Muyaga', '10122017', 'Tugirimana taguze isambu na Ndereyimana; amafaranga ibihumbi ijana ( 100000rwfr). Yaje kujya ayamwishyura mu byiciro ntiyabasha kuyamuha yose, ariko akemeza ko yarangije kumwishyura.Ndereyimana yaje kumurega ariko ntibyagira icyo bitanga.Nyirukugurisha yi', 'ok', '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(101, '2.5079E+11', '1513677374', '1111', 'ubutaka', 'imbibi', 'Bizimana Jean Berchmas', 'Mataba', '', 'Gore', '789741641', 'NYIRARUKUNDO Josephine', 'Gabo', 'North', 'Gakenke', 'Mataba', 'Gikombe', 'Muhororo', '10122017', 'Nyirarukundo yashakanye na Ndereyimana, bamaze kubyarana umwana umwe, bagirana ibibazo,urukiko rurabatandukanya. Urukiko rwategetse ko imitungo bafite bayigabana; none umugabo yanze ko bagabana isambu bafitanye. Bagombaga kuhagurisha bakagabana amafaranga', 'ok', '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(102, '2.5079E+11', '1513677374', '1111', 'ubutaka', 'imbibi', 'Ntibarikure Fulgence', 'Nyamugari', '', 'Gabo', '789741641', 'Kamanda Stapin', 'Gabo', 'West', 'Kirehe', 'Nyamugari', 'Nyamugari', 'Shuriro', '10122017', 'Uwitwa Odette yatwaye ubutaka  (imigende) iri mu gishanga ngo ni iye kuko isambu ye igera ku gishanga', 'ok', '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(103, '2.5079E+11', '1513677374', '1111', 'ubutaka', 'imbibi', 'Tuyisenge Betty', 'Karambo', '', 'Gore', '789741641', 'NYIRAMANA Florence', 'Gabo', 'North', 'Gakenke', 'Karambo', 'Kirebe', 'Bukunga', '10122017', 'Kutagira ibyangombwa by\'isambu yanjye', 'ok', '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(104, '2.5079E+11', '1513677374', '1111', 'ubutaka', 'imbibi', 'Musabwasoni felicite', 'Karambo', '', 'Gabo', '789741641', 'NIZEYIMANA Thoneste', 'Gabo', 'North', 'Gakenke', 'Karambo', 'Kirehe', 'Mubuga', '10122017', 'Umuyoboro w\'amazi hagati y\'amazu ya Nizeyimana na Mbarushimana', 'ok', '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(105, '2.5079E+11', '1513677374', '1111', 'ubutaka', 'imbibi', 'Nzayisenga Laurent', 'Mushikiri', '', 'Gabo', '789741641', 'Ntawumenyumunsi J Pierre', 'Gore', 'East', 'Kirehe', 'Mushikiri', 'Bisagara', 'Nkoyoyo', '10122017', 'Ikibazo gishingiye ku izungura ry\' umutungo w\' ababyeyi risumbanya abana aho mu rubanza rwa Iwerne n\' Abunzi b\' umurenge aho Uyu Ntawumenyumunsi Jean Pierre bisa nk\'aho yakuwe mu mutungo w\' ababyeyi, umugabane Munini ngo ugahabwa mushikiwe Musabyemariya V', 'ok', '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(106, '2.5079E+11', '1513677374', '1111', 'ubutaka', 'imbibi', 'Mukurubibi claudine', 'Mushikiri', '', 'Gore', '789741641', 'Mukadusabe Rachel', 'Gabo', 'East', 'Kirehe', 'Mushikiri', 'Bisagara', 'Umunini', '10122017', 'Umugabo we amaze kwitaba imana, umuryango yashatsemo washatse kumwirukana mu rugo rwe bashaka kwigarurira imitungo kuko batasezeranye. Bagiye mu manza imitungo imwe arayihabwa ariko hari iyo atarabona ari nayo ari kuburana mu bunzi b\' umurenge.', 'ok', '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(107, '2.5079E+11', '1513677374', '1111', 'ubutaka', 'imbibi', 'Nyabenda Felix', 'Nyamugari', '', 'Gabo', '789741641', 'Karemera Leonidas', 'Gabo', 'East', 'Kirehe', 'Nyamugari', 'Nyamugari', 'Ihuriro', '10122017', 'Kuba yaraguze imirimo 2 na Kayonga Edouard nyuma agashaka kubumuhuguza kandi afite amasezerano y,ubugure nyuma y,aho yangiye ko bwahinduza icyangombwa ngo ubutaka bumwandikweho.', 'ok', '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(108, '2.5079E+11', '1513677374', '1111', 'ubutaka', 'imbibi', 'Felix Nyabenda', 'Nyamugari', '', 'Gabo', '789741641', 'Nzogiroshya Joseph', 'Gabo', 'East', 'Kirehe', 'Nyamugari', 'Nyamugari', 'Kabeza', '10122017', 'Ikibazo cye ni uko Kwamp yakoze ikiyaga noneho ubutaka bwe bukagenderamo nyuma bakamuha ingurane none ushinzwe ubutaka mu Murenge yamusabye icyangombwa ngo bakureho ubutaka bw,icyo kiyaga angarurire icyangombwa ubu hashize amezi  8 yarakinyimye kandi hari', 'ok', '0000-00-00 00:00:00', '0000-00-00 00:00:00');
INSERT INTO `community_policing` (`id`, `msisdn`, `requestdate`, `registered_code`, `type_of_issue`, `land_type_of_issue`, `victim`, `sector_where_the_issue_is`, `other_type_details`, `gender_of_victim`, `phone_number`, `suspect`, `gender_of_suspect`, `province`, `district`, `sector`, `cell`, `village`, `date_and_time`, `short_description_of_the_issue`, `conclusion`, `created_at`, `updated_at`) VALUES
(109, '2.5079E+11', '1513677374', '1111', 'ubutaka', 'imbibi', 'Nyirakimonyo Irene', 'Muhima', '', 'Gabo', '789741641', 'NSENGIYUMVA Emmanuel', 'Gore', 'Kigali', 'Nyarugenge', 'Muhima', 'Kabeza', 'Ikaze', '10122017', 'Umukecuru; Nyirankangura Suzana yahaye uburage abuzukuru be aribo: NSENGIYUMVA Emmanuel na Kabagwira Patience. Nyuma y\'uko yitaba Imana muri 2014, Nyina w\'aba bana yashatse guhinduza icyangombwa; haza abandi buzukuru bakomoka ku wundi mwana wa Nyirakuru, ', 'ok', '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(110, '2.5079E+11', '1513677374', '1111', 'ubutaka', 'imbibi', 'Twizerimana Justine', 'Gitesi', '', 'Gore', '789741641', 'NYIRABAMPORIKI Antoinette', 'Gore', 'West', 'Karongi', 'Gitesi', 'Kanunga', 'Nemba', '10122017', 'Twaburanye isambu n\'umuhungu wanjye, nyuma urukiko rw\'ibanze rurangije urubanza; uwo muhungu wanjye ashinga imbago nabi; bashyira imbibi ahatari ho', 'ok', '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(111, '2.5079E+11', '1513677374', '1111', 'ubutaka', 'imbibi', 'Nyirantuyahaga MarievTherese', 'Gitesi', '', 'Gore', '789741641', 'MUKARUKAKA Esther', 'Gabo', 'West', 'Karongi', 'Gitesi', 'Munanira', 'Gahigiro', '10122017', 'Nahawe imirima itandatu (6) na Databukwe na Mabukwe. Umugabo twari twarashakanye, yaje kunyirukana; ikibazo naje gusubira kujya mpinga imirima yanjye; akajya ayinyima kandi narayihawe, mfite n\'urupapuro rwanditse.', 'ok', '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(112, '2.5079E+11', '1513677374', '1111', 'ubutaka', 'kwandikisha ', 'Mukarusine gaudeleve', 'Gitesi', '', 'Gore', '789741641', 'MUKANTAGARA Console', 'Gabo', 'West', 'Karongi', 'Gitesi', 'Nyamiringa', 'Burega', '10122017', 'Twasigaye turi babiri, njye na Musaza wanjye. Amasambu badusigiye ashaka kuyiharira wenyine, ngo jye ntacyo nabona, kuko ndi umukobwa. Kandi ndi indushyi itagira kirengera', 'ok', '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(113, '2.5079E+11', '1513677374', '1111', 'ubutaka', 'kwandikisha ', 'Kundabayo Jurdas', 'Gitesi', '', 'Gabo', '789741641', 'SIKUBWABO Nehemie', 'Gore', 'West', 'Karongi', 'Gitesi', 'Munanira', 'Munanira', '10122017', 'Naguze ubutaka na MUJYAMBERE Jrme; none uwo mugabo yarabuze, nta muntu uzi aho aherereye.Ikibazo yabuze hatarabaho guhinduza ibyangombwa ngo ubutaka bunyandikweho kuko twabuguze', 'ok', '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(114, '2.5079E+11', '1513677374', '1111', 'ubutaka', 'kwandikisha ', 'Sindayigaya Jonas', 'Gitesi', '', 'Gore', '789741641', 'MUKARUKAKA Esther', 'Gore', 'West', 'Karongi', 'Gitesi', 'Munanira', 'Gahigiro', '10122017', 'Nari nahawe umurima  na Databukwe na Mabukwe, nk\'impano.Nyuma umugabo yaje kunyirukana.Tumaze gutandukana, barahanyambura, kandi inyandiko y\'uko bampaye ndayifite ndetse n\'ubutaka nabwibarujeho ko ari ubwanjye.', 'ok', '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(115, '2.5079E+11', '1513677374', '1111', 'ubutaka', 'kwandikisha ', 'Harerimana jean paul', 'Gitesi', '', 'Gore', '789741641', 'NYIRAMIHIGO Sophie', 'Gabo', 'West', 'Karongi', 'Gitesi', 'Gasharu', 'Gasharu', '10122017', 'Jye na murumuna wanjye, twaragijwe isambu n\'ababyeyi.Batubwiye ko musaza wacu naza tuzayimuha.Ababyeyi bongeraho ko naramuka abuze, tuzayigabana.None kuva 1994, ntaragaruka.Ikibazo nuko mu kujya kuyigabana, murumuna wanjye ari kuyiharira yitwaje impapuro ', 'ok', '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(116, '2.5079E+11', '1513677374', '1111', 'ubutaka', 'kwandikisha ', 'Nyirakimonyo irene', 'Gitesi', '', 'Gabo', '789741641', 'HABIMANA Jean Npomuscne', 'Gabo', 'West', 'Karongi', 'Gitesi', 'Munanira', 'Gahigiro', '10122017', 'Leta yamfatiye ubutaka, bitewe n\'isoko y\'amazi ihabonye. Ubwo butaka yarabufatiriye, ntiyampa n\'ingurane yabwo, kandi na njye narabukoreshaga, mu gutunga umuryango wanjye', 'ok', '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(117, '2.5079E+11', '1513677374', '1111', 'ubutaka', 'kwandikisha ', 'Nyabenda felix', 'Gitesi', '', 'Gore', '789741641', 'HITIYAREMYE Rachel', 'Gore', 'West', 'Karongi', 'Gitesi', 'Gitega', 'Bugoberi', '10122017', 'Nabuze icyangombwa cy\'ubutaka bwanjye, kandi narafotoje ubutaka.Mu gihe iby\'abandi byasohokaga, icyanjye ntikigeze gisohoka.Nageze mu buyobozi, bantuma agapapuro k\'ubutaka ndagatanga, ariko maze amezi atatu njyayo gushaka ibyangombwa nkabibura.Nkaba ndi k', 'ok', '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(118, '2.5079E+11', '1513677374', '1111', 'ubutaka', 'kwandikisha ', 'Nyirakimonyo Irene', 'Gitesi', '', 'Gore', '789741641', 'NYIRARWIMO Farasie', 'Gore', 'West', 'Karongi', 'Gitesi', 'Rwariro', 'Kigarama', '10122017', 'Ikibazo cyanjye nuko nahawe umunani n\'ababyeyi banjye batarapfa, nyuma bamaze gupfa, musaza wanjye arabinyambura', 'ok', '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(119, '2.5079E+11', '1513677374', '1111', 'ubutaka', 'kwandikisha ', 'Karamuka Celestin', 'Gitesi', '', 'Gore', '789741641', 'UBIZEYE Jacqueline', 'Gore', 'West', 'Karongi', 'Gitesi', 'Ruhinga', 'Nyabikati', '10122017', 'Jye n\'umugabo wanjye twahawe umunani; none umugabo yazanye undi mugore. Umugabo ari kumpeza  ku munani kandi ni jye twasezeranye ivangamutungo', 'ok', '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(120, '2.5079E+11', '1513677374', '1111', 'ubutaka', 'kwandikisha ', 'Mukangarambe Dative', 'Gataraga', '', 'Gabo', '789741641', 'NGERAGEZE Jean Baptiste', 'Gore', 'North', 'Musanze', 'Gataraga', 'Rubindi', 'Kaberege', '10122017', 'Ikibazo ni icy\'imbibi dufitanye n\'ubutaka bwa Police; Jyewe Ngerageze Jean Paptiste ( no3) Ntibakunzwe Jean Baptiste ( no5)na Shirubwiko Jean( no2). Cyakoze police yo yaje gukuraho amakimbirane kuko yabonye icyangombwa cya Burundu ndetse iduha na Kopi. Tw', 'ok', '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(121, '2.5079E+11', '1513677374', '1111', 'ubutaka', 'kwandikisha ', 'Gahayire Evariste', 'Gashari', '', 'Gabo', '789741641', 'MWEREKANDE Elisephan', 'Gore', 'West', 'Karongi', 'Gashari', 'Birambo', 'Kakibereka', '10122017', 'Akagari kanze icyemezo cy\'ifotora ry\'ubutaka, banze n\'umurage w\'umwana ndera yahawe na Nyirakuru, yasize akoze atarapfa.', 'ok', '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(122, '2.5079E+11', '1513677374', '1111', 'ubutaka', 'kwandikisha ', 'Ahmed Gakombe', 'Nyamugari', '', 'Gabo', '789741641', 'Mbonera', 'Gabo', 'East', 'Kirehe', 'Nyamugari', 'Nyamugari', 'Muramba', '10122017', 'Basendizabo Dancille yamuhuguje imigende iri mu gishanga ifatanye n,isambu ye ndetse akavuga ko iyo migende iri ku butaka bwe ndetse ko n,abandi bari badikanyije bo bararwnye baratemana Police iratabara.', 'ok', '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(123, '2.5079E+11', '1513677374', '1111', 'ubutaka', 'kwandikisha ', 'Nyirakimonyo Herene', 'Gashari', '', 'Gabo', '789741641', 'MBWAYAHO Cyprien', 'Gabo', 'West', 'Karongi', 'Gashari', 'Rugobagoba', 'Karambo', '10122017', 'Urukiko rwanze gutera cachet mpuruza ku myanzuro y\'abunzi yo ku itariki 20/04/2016', 'ok', '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(124, '2.5079E+11', '1513677374', '1111', 'ubutaka', 'guhererekanya', 'Mukagasana Emerianne', 'Kanyinya', '', 'Gabo', '789741641', 'Nzigira Joseph', 'Gabo', 'Kigali', 'Nyarugenge', 'Kanyinya', 'Taba', 'Ngendo', '10122017', 'Leta ya cyera yantwariye ubutaka muri  1982 inyemerera ingurane nanubu sindayibona none ubwo butaka uwari mayor mukasonga Solange yabwibarujeho', 'ok', '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(125, '2.5079E+11', '1513677374', '1111', 'ubutaka', 'guhererekanya', 'Kanzayire leocodia', 'Kamubuga', '', 'Gore', '789741641', 'TUYISENGE Aunorine', 'Gore', 'North', 'Gakenke', 'Kamubuga', 'Mbatabata', 'Mbatabata', '10122017', 'Papa yashatse undi mugore. Mama yari afite amasambu atarapfa. Aho amariye Gupfa, amasambu ye yose papa yahise ayibaruzaho kuko twari tukiri bato. Ayo masambu yayahayemo umunani abana b\'umugore muto . Namwatse umunani ambwira ko nta masambu afite, ko ahari', 'ok', '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(126, '2.5079E+11', '1513677374', '1111', 'ubutaka', 'guhererekanya', 'Murazeyezu Gerard', 'Nyundo', '', 'Gore', '789741641', 'Nyiranshimiyimana Jeane d\'Arc', 'Gore', 'West', 'Rubavu', 'Nyundo', 'Muhima', 'Gitebe 1', '10122017', 'Nyiranshimiyimana yaguze ubutaka na Nkurunziza Elie, nawe wabuze n\'umuntu wahawe n\'ababyeyi be, ari nabo banditse ku cyangombwa cy\'ubwo butaka, ariko bakaba barapfuye', 'ok', '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(127, '2.5079E+11', '1513677374', '1111', 'ubutaka', 'guhererekanya', 'Kundabayo jurdas', 'Kigarama', '', 'Gabo', '789741641', 'Hafashimana Protais', 'Gabo', 'East', 'Kirehe', 'Kigarama', 'Kizarama', 'Nyamiyaga', '10122017', 'Kuba yaraguze ubutaka n,uwitwa Cyrille Ruzigana ariko kugeza ubu akaba nta cyangombwa cyabwo arabona.', 'ok', '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(128, '2.5079E+11', '1513677374', '1111', 'ubutaka', 'guhererekanya', 'Zikamabahari emille', 'Rubavu', '', 'Gore', '789741641', 'NYIRAGAHINDA Sovronie', 'Gore', 'West', 'Rubavu', 'Rubavu', 'Nyundo', 'Shonyi', '10122017', 'NYIRAGAHINDA Sovronie  yaburanye umurima na mwene wabo witwa Gahagama Joseph. Urukiko rwaje kwemeza ko bagomba kugabana imirima yose.Bamaze kugabana, ku ruhare rwe aza kunyagwa n\'uwitwa Bucyana Aloys.Ubwo yari yarahungiye muri Congo, agarutse asanga yaram', 'ok', '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(129, '2.5079E+11', '1513677374', '1111', 'ubutaka', 'guhererekanya', 'Damien Musabyimana', 'Kigarama', '', 'Gabo', '789741641', 'Serugendo Job', 'Gabo', 'East', 'Kirehe', 'Kigarama', 'Karemera', 'Kagane', '10122017', 'Umugabo witwa Twizerimana Emmanuel yaramurengereye ku butaka ahateye ishyamba', 'ok', '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(130, '2.5079E+11', '1513677374', '1111', 'ubutaka', 'guhererekanya', 'Ntivuguruzwa Cyprien', 'Kivuruga', '', 'Gabo', '789741641', 'SEBAZUNGU Stanislas', 'Gore', 'North', 'Gakenke', 'Kivuruga', 'Cyintare', 'Bigogwe', '10122017', 'Jye; Sebazungu nabonye icyangombwa cy\'ubutaka, ariko, nkibona cyanditseho ko ari ubutaka bw\'akarere, kandi ari ubwanjye bwite.Ndifuza guhabwa ibisobanuro byimbitse kuko ubutaka ari ubwanjye', 'ok', '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(131, '2.5079E+11', '1513677374', '1111', 'ubutaka', 'guhererekanya', 'Nizeyimana Jean Pierre', 'Kivuruga', '', 'Gabo', '789741641', 'HABUMUGISHA Valens', 'Gabo', 'North', 'Gakenke', 'Kivuruga', 'Cyintare', 'Buhuga', '10122017', 'Mu ibarura ry\'ubutaka,abakozi b\'ibarura bampaye gitansi, ariko sinabona icyemezo cya burundu cy\' ubutaka', 'ok', '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(132, '2.5079E+11', '1513677374', '1111', 'ubutaka', 'guhererekanya', 'Niyibizi Fidele Sinzi', 'Busengo', '', 'Gabo', '789741641', 'BAZIRAMWABO Thogne', 'Gore', 'North', 'Gakenke', 'Busengo', 'Birambo', 'Birambo', '10122017', 'Mama wa Baziramwabo, mushiki wa NKINGAMUBIRI Claude; yapfuye Thogne akiri muto.Akaba yari yarashakiye i Kigali.Baje kugabana amasambu y\'ababyeyi babo, birengagiza ko Baziramwabo ahari.Aho abonekeye, yegereye bamwe mu muryango bamwereka amasambu yazunguw', 'ok', '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(133, '2.5079E+11', '1513677374', '1111', 'ubutaka', 'guhererekanya', 'Uzabakiriho Zacharie', 'Kimisagara', '', 'Gabo', '789741641', 'ABANGANA Thomas', 'Gabo', 'Kigali', 'Nyarugenge', 'Kimisagara', 'Kamuhoza', 'Karama', '10122017', 'Yabuze icyangombwa cy\'ubutaka bwe.ubu ikibazo kigeze ku rwego rw\'akarere aturutse ku rwego rw\'umudugudu', 'ok', '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(134, '2.5079E+11', '1513677374', '1111', 'ubutaka', 'guhererekanya', 'Ntibera mathias', 'Nyamyumba', '', 'Gabo', '789741641', 'Barikunda Celestin', 'Gore', 'West', 'Rubavu', 'Nyamyumba', 'Rubona', 'Bunyago', '10122017', 'Naguze na Databukwe isambu, agabanya igipande ku isambu ye, none namusabye ko twajya guhinduza bantegeka ko ngomba gusorera ubwo butaka bwose, kdi ari agapande gato mfite. Nabwira Databukwe akaganga kubusorera.', 'ok', '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(135, '2.5079E+11', '1513677374', '1111', 'ubutaka', 'guhererekanya', 'Nyiramukamisha  Emma', 'Kacyiru', '', 'Gabo', '789741641', 'NGAMIJE Franois', 'Gabo', 'Kigali', 'Gasabo', 'Kacyiru', 'Kamutwa', 'Agasaro', '10122017', 'Ngamije franois, yaguze inzu na Daniel MUHIRWA NDEKEZI, ariko amuha ibyangombwa by\'indi nzu itandukanye n\'iyo yamweretse bagura.Ikindi kandi n\'iyo nzu Ngamije yaherewe ibyangombwa, nayo yari yaragurishijwe ku wundi muntu; kandi bombi bakaba bari bafite i', 'ok', '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(136, '2.5079E+11', '1513677374', '1111', 'ubutaka', 'guhererekanya', 'Byimana claudine', 'Rusororo', '', 'Gabo', '789741641', 'Ruhumuriza Narcisse', 'Gabo', 'Kigali', 'Gasabo', 'Rusororo', 'Bisenga', 'Kidogo', '10122017', 'Horizon yantwariye icyangombwa bavuga ko bazanyishyura ubutaka bwanjye bangineza none hashize imyaka 3', 'ok', '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(137, '2.5079E+11', '1513677374', '1111', 'ubutaka', 'guhererekanya', 'Mujawayezu immaculee', 'Rusororo', '', 'Gore', '789741641', 'Uwineza Janviere', 'Gabo', 'Kigali', 'Gasabo', 'Rusororo', 'Ruhanga', 'Mirama', '10122017', 'Uyu mwana afite ikibanza kirimo n\'amazu yasigiwe nase witwagaga Murenzi Robert amaze gupfa, none uwamureraga akaba na Nyiramurushya Venantia yarahagurishije naho yaguze yanze kuhanyereka kandi aribo bandera. Mpisemo gutanga icyo kibazo.', 'ok', '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(138, '2.5079E+11', '1513677374', '1111', 'ubutaka', 'guhererekanya', 'Kampundu Beatrice', 'Nyamirambo', '', 'Gore', '789741641', 'Mamandare Candide', 'Gabo', 'Kigali', 'Nyarugenge', 'Nyamirambo', 'Gasharu', 'Kagunga', '10122017', 'Uyu unite ikibazo yaguze ubutaka n,umuturage usanzwe afite ibyangombwa cya burundu, agiye gusaba ngo bamukatireho ubwe butaka ngo abone icyangombwa cye, bamubwira ko bitashoboka kuko afite ubuso buri minsi ya 700 m2 bamubwira ko agomba kujya ku mugereka. ', 'ok', '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(139, '2.5079E+11', '1513677374', '1111', 'ubutaka', 'guhererekanya', 'Niyigaba Joseph', 'Nyakabanda', '', 'Gore', '789741641', 'Kabagwira Sada', 'Gabo', 'Kigali', 'Nyarugenge', 'Nyakabanda', 'Nyakabanda', 'Nyakabanda', '10122017', 'Igabana ry,ubutaka hagati y,umuvandimwe Bizimungu Ismael akaba yarabyanze nk,uko urukiko rwari rwarabyemeje', 'ok', '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(140, '2.5079E+11', '1513677374', '1111', 'ubutaka', 'guhererekanya', 'Munyaneza justin', 'Rusororo', '', 'Gabo', '789741641', 'Gakwerere Ernest', 'Gore', 'Kigali', 'Gasabo', 'Rusororo', 'Bisenga', 'Kidogo', '10122017', 'Ntabwo mbaha kugira icyo nkore shall ubutaka kuko hashize imyaka ibiri, Horizon itubariye ikaba itatwishyura kandi kubera urutambi baturitsa inzu yamaze kwangirika nayo nkaba ntemererwa kuyisana.', 'ok', '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(141, '2.5079E+11', '1513677374', '1111', 'ubutaka', 'guhererekanya', 'Kangabe Dative', 'Rusororo', '', 'Gabo', '789741641', 'Uwimana Emmanuel', 'Gabo', 'Kigali', 'Gasabo', 'Rusororo', 'Bisenga', 'Kidogo', '10122017', 'Horizon yantwariye icyangombwa cy\'ubutaka hashize imyaka 3 bavuga ko bazatwishyura ubutaka kuko bahakorera.', 'ok', '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(142, '2.5079E+11', '1513677374', '1111', 'ubutaka', 'guhererekanya', 'Twagirayezu jean damour', 'Gatenga', '', 'Gabo', '789741641', 'Kubwimana Claude', 'Gore', 'Kigali', 'Kicukiro', 'Gatenga', 'Gatenga', 'Gakoki', '10122017', 'Kubwimana Claude avukana na Habineza Vincent. Kubwimana Claude avuga ko yahawe inzu na mukuru we ariwe Habineza Vincent mu mwuka wa 2009. Habineza Vincent yaje kwiyandikishaho ubutaka bwose n,ikibanza kirimo inzu yari yarahaye Kubwimana.', 'ok', '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(143, '2.5079E+11', '1513677374', '1111', 'ubwicanyi', '', 'Nyirantezimana Judith', 'Gatenga', '', 'Gabo', '789741641', 'Twagirayezu Vedaste', 'Gabo', 'Kigali', 'Kicukiro', 'Gatenga', 'Gatenga', 'Amahoro', '10122017', 'Twagirayezu Vedaste ararega Mukashimwe Odette. Mukashimwe Odette yaguze aho atuye mu 1998. Twagirayezu Vedaste agaragaza Kuwa 3/12/2014.Twagirayezu Vedaste aravuga ko aho yaguze harimo n,igikoni kiri muri parcel ya Mukashimwe Odette.', 'ok', '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(144, '2.5079E+11', '1513677374', '1111', 'ubwicanyi', '', 'Mukankubito alphonsine', 'Gikondo', '', 'Gore', '789741641', 'Mukagatare Drocelle', 'Gabo', 'Kigali', 'Kicukiro', 'Gikondo', 'Kagunga', 'Kagunga', '10122017', 'Mukagatare Drocelle yagiranye ikibazo cy,imbibi na Seruvumba Rutinywa Thierry bagejeje ikibazo cyabo mu buyobozi bw,umurenge bageregeza kubumvikanisha ariko ntabwo ubwumvikane babwubahirije kandi Rutinywa Thierry niwe warengereye Drocelle.', 'ok', '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(145, '2.5079E+11', '1513677374', '1111', 'ubwicanyi', '', 'Dushimimana Emmanuel', 'Gikondo', '', 'Gore', '789741641', 'NA', 'Gabo', 'Kigali', 'Kicukiro', 'Gikondo', 'Kinunga', 'NA', '10122017', 'Hari ikibazo cy,ubutaka baburana ariko bose nta nyandiko bagaragaza zemeza  nyirubutaka uwo ari we kuko MINAGRI ariyo yatanze ubwo butaka bwose. Umurenge wandikiye Akarere ugasaba  kujya muri MINAGRI kugirango bagaragaza ba nyiri3ubwo butaka.', 'ok', '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(146, '2.5079E+11', '1513677374', '1111', 'ubwicanyi', '', 'Mushimiyimana Emmanuel', 'Niboye', '', 'Gabo', '789741641', 'Ruzigamanzi Leodgard', 'Gore', 'Kigali', 'Kicukiro', 'Niboye', 'Gatare', 'Kigarama', '10122017', 'Uwitwa Muyango Franoise  yarengereye ubutaka bwe  (yarengereye 10m/2m) ibi avuze bikaba byaragaragajwe n,inzego zibishinzwe  (topography)', 'ok', '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(147, '2.5079E+11', '1513677374', '1111', 'ubwicanyi', '', 'Nyirantezimana Judith', 'Rusororo', '', 'Gabo', '789741641', 'Munyabagisha Theophile', 'Gore', 'Kigali', 'Gasabo', 'Rusororo', 'Bisenga', 'Kidogo', '10122017', 'Horizon yantwariye icyangombwa cy\'ubutaka bavuga ko bagiye kutubarira bazatwishyura none hashize imyaka 3 bataratwishyura kandi tutemerewe kugira icyo tuhakorera', 'ok', '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(148, '2.5079E+11', '1513677374', '1111', 'ubwicanyi', '', 'Ngendahimana Theogene', 'Rusororo', '', 'Gabo', '789741641', 'Tugirimana', 'Gore', 'Kigali', 'Gasabo', 'Rusororo', 'Bisenga', 'Kidogo', '10122017', 'Horizon yatwaye icyangombwa cy\'ubutaka bwanjye bavuga ko bagiye kubugura kubera ko batwangirije , hashize imyaka 3 twarababuze', 'ok', '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(149, '2.5079E+11', '1513677374', '1111', 'ubwicanyi', '', 'Gahutu Daniel', 'Rusororo', '', 'Gabo', '789741641', 'Mbuzehose JMV', 'Gore', 'Kigali', 'Gasabo', 'Rusororo', 'Busenga', 'Kidogo', '10122017', 'Twaguze ikibanza ariko twabuze nyiracyo ngo dukore mutation kandi ntabwo tuzi nimero yacyo.', 'ok', '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(150, '2.5079E+11', '1513677374', '1111', 'ubwicanyi', '', 'Ramadhani Dusengimana', 'Kigarama', '', 'Gabo', '789741641', 'Karimba Narcisse', 'Gore', 'Kigali', 'Kicukiro', 'Kigarama', 'Nyarurama', 'Zuma', '10122017', 'Karimba Narcisse yaguze ubutaka abubonera icyangombwa cya burundu, ahishakiye icyangombwa cyo kucyubaka, ari kubaka asanga ubuso bwe ntibwuzuye bigaragara ko imbibi ze zishobora kuba zarimuwe atabizi. Abaguze nyuma ye baguze ibyangombwa kuko yanze kubasin', 'ok', '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(151, '2.5079E+11', '1513677374', '1111', 'ubwicanyi', '', 'Kampororo Josephine', 'Kigarama', '', 'Gore', '789741641', 'Hategekimana Marcella', 'Gabo', 'Kigali', 'Kicukiro', 'Kigarama', 'Kigarama', 'Amahoro', '10122017', 'Uwo mutungo wose wakomotse kuri Hategekimana Marcella ashakana na Nkikabahizi Andre byemewe n,amategeko, babana mu makimbirane kugeza ubwo yamumenesheje mu rugo akaba amaze umwaka n,amezi 8 ataba mu rugo. Umutungo wose n,ibiwukomokaho wihariwe na Nkikabah', 'ok', '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(152, '2.5079E+11', '1513677374', '1111', 'ubwicanyi', '', 'Nubashyimfura Andre', 'Kigarama', '', 'Gore', '789741641', 'Nyirandungutse Felicite', 'Gabo', 'Kigali', 'Kicukiro', 'Kigarama', 'Kigarama', 'Umucyo', '10122017', 'gjfgyhj', 'ok', '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(153, '2.5079E+11', '1513677374', '1111', 'ubwicanyi', '', 'Ntihemuka Fiston', 'Gikondo', '', 'Gore', '789741641', 'UWAMAHORO Solange', 'Gore', 'Kigali', 'Kicukiro', 'Gikondo', 'Kinunga', 'NA', '10122017', 'Uwamahoro Solange ,umwana wa Nyiramfakaramye Alphonsine( witabye Imana); avuga ko hari inzu y\'igikoni cya Charlotte atekeramo,  atari icye.Ariko ibi akaba abivuze aruko Nyina; Alphonsine amaze gupfa, kandi akiriho  Charlotte yahakoreshaga hose, nta kibazo', 'ok', '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(154, '2.5079E+11', '1513677374', '1111', 'ubwicanyi', '', 'Gakwerere Damascene', 'Rusenge', '', 'Gabo', '789741641', 'Parage Clistophore', 'Gabo', 'South', 'Nyaruguru', 'Rusenge', 'Raranzige', 'Akabacura', '10122017', 'Mama yaraze inzu murumuna wanjye, none arashaka gutwara n\'ingaririgari zose tutazigabanye. Yahawe inzu gusa, ariko akaba ashaka n\'ibyangombwa by\'imirima yari iya Mama', 'ok', '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(155, '2.5079E+11', '1513677374', '1111', 'ubwicanyi', '', 'Uwayisaba Venuste', 'Rusenge', '', 'Gore', '789741641', 'MUREKATETE Clmentine', 'Gore', 'South', 'Nyaruguru', 'Rusenge', 'Raranzige', 'Karimba', '10122017', 'Nandikishije ubutaka, hasohoka ibyangombwa bibiri ( 2 ) kandi hari kuza bitatu( 3). Nabuze icyemezo cy\'amashyamba n\'ikimirima yo mu kabande', 'ok', '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(156, '2.5079E+11', '1513677374', '1111', 'ubwicanyi', '', 'Baraka Cyprien', 'Rusenge', '', 'Gore', '789741641', 'MUKASHYAKA Batha', 'Gabo', 'South', 'Nyaruguru', 'Rusenge', 'Raranzige', 'Akabacura', '10122017', 'Mama arashaje cyane.Yabaruriwe ubutaka ariko nta cyangombwa arabona, ngo kuberako atagira irangamuntu.Yifuza ko icyangombwa cyasohoka mu mazina yanjye, kandi jyewe mfite irangamuntu nta kibazo nagira.Gusa, apfuye tudafite icyangombwa, havuka amakimbirane', 'ok', '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(157, '2.5079E+11', '1513677374', '1111', 'ubwicanyi', '', 'Ntakirutimana Pierre', 'Mageragere', '', 'Gabo', '789741641', 'Nshimiyimana Valens', 'Gabo', 'Kigali', 'Nyarugenge', 'Mageragere', 'Nyarurenzi', 'Iterambere', '10122017', 'Ni ubutaka nshimiyimana yaguze asanga nyirabwo atarabubaruje ahubwo uwo badikanyije ariwe wabwibarujeho (yabufatanyije nubwe) ariko akaba yarabyemeje mu mudugudu ko yibarujeho ubutaka butarubwe.', 'ok', '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(158, '2.5079E+11', '1513677374', '1111', 'ubwicanyi', '', 'Mukansanga Godeleine', 'Mageragere', '', 'Gore', '789741641', 'Kamparage Peteronille', 'Gore', 'Kigali', 'Nyarugenge', 'Mageragere', 'Nyarurenzi', 'Nyabirondo', '10122017', 'cgkcghk', 'ok', '0000-00-00 00:00:00', '0000-00-00 00:00:00');
